INSERT INTO `m_company` (`Id`, `Name`, `Address`, `Domain`, `Reg_No`, `Code`, `About`, `SupplierAvgRating`, `BuyerAvgRating`, `AwardedQuotation`, `SubmittedQuotation`, `IsVerified`) VALUES
(1, 'Cititech Industrial Engineering Pte Ltd', '113 Neythal Road?Singapore 628600', 'cititech@singnet.com.sg', '199100687M', '-', 'About\nCititech Industrial Engineering Pte Ltd, was founded in 1994 by Mr Siew Y.F . Cititech Industrial Engineering is a metal fabrication and machine shop that has been producing high quality metal products for over 20 years. Majority of our business has been producing customise products based on customers drawings and specification, but they do sometimes provide us with ideas and we are able to help them develop it into drawings and products.\n\n\nCompany\nWe started off with a rented factory in Jurong having a floor space of 2,500 sq ft and 5 staffs. In 1997, our company shifted into a larger premise of 9,000 sq ft at Woodlands and expanded our workforce to 20. In August 2001, we moved to our current premise, 113 Neythal Road with a 58,000 sq ft floor space and with a workforce of 40+ personnel.\n\n\nCapabilities\nSince 1994, we have been fulfilling our aim of being a One-Stop Manufacturing Center for sheet metal fabrication products. Cititech Industrial have invested heavily in machines and engineering software in past years. We are now capable of fabricating metal to wide range of products such as small souvenirs, mid size fire proof doors/server racks to full sized structural (Automation Equipment Structural / Base Pump Structural...etc) completed with power coating upon request. The wide range of products we fabricate requires us to work with a wide range of material; Stainless Steel, Aluminium, Mild Carbon Steel, Copper, Brass and some Plastics(acrylic etc).\n\n\nAwards\nThis One Stop Process fabrication process is made possible by our team of dedicated and experienced staff . Using up-to-date CAD\\CAM\\3D software together with state-of-art machinery. From the use of laser cutting machines, turret punching machines, metal bending/forming machines as well as powder coating and painting, this production process ensures high precision, fabricating only top quality products. Our hard work and dedication in fabricating high quality products has been acknowledge when Cititech Industrial Engineering Pte Ltd was awarded the distinguished ISO 9002 Quality Assurance Award in 1999 and later upgraded to ISO 9001:2008 Quality Assurance Award in 2002. In the year 2012 we have also proudly receive the BizSAFE STAR award.\n\n\nSubsidiary\nWith opportunity, we have branched into the Park Recreation Industry. As a result, EQ Cititech Recreation Pte Ltd, a subsidiary company specialised  in playground equipment, outdoor fitness equipment, park benches and other park accessories, was formed. EQ Cititech since been successfully awarded several government projects.\n\n\nMission\n\"To fabricate highest quality products with on time deliveries at a cost effective and competitive price and to provide complete customer satisfaction by going the extra mile to satisfy their needs.\"\n\n\nGoal\n\"To provide our customer with high quality products and provide friendly and professional service at an exception value. We believe in having a positive attitude and thinking about business and will do whatever it takes to earn our customer satisfaction. The most valuable things we have are our customers, suppliers and employees, we will continuously strive to create better relationships and improve communications with all of them.\"\n\n\nDO IT RIGHT \nTHE FIRST TIME \nAND \nEVERYTIME', '0.00', '0.00', 0, 0, b'0'),
(2, 'Iron-Man Fabrication Pte Ltd', '9A Lok Yang Way, Singapore 628628 ', 'sales@ironman.com.sg', '199302127D', '-', 'IRON-MAN FABRICATION PTE LTD SINGAPORE\nWe Specialise In Custom Fabrication Of A Wide Range Of Stainless Steel Products\nOur company specialises in custom fabrication of a wide range of stainless steel products to cater to our customer?s requirements. Our management personnel and fabrication team are equipped with many years of related experience, and we are committed to provide a total quality package in ensuring competitive, functional finished products to all our customers.\nOur Products Range From:\n- Stainless Steel Fabricators\n- Electronic Industries\n- Engineering Works\n- Hospital Equipment\n- Kitchen Equipment\n- Laboratory Furniture\n- Stainless Steel Fabricators\n- Steel Fabricators\n- Trolleys\nView our Gallery for past stainless steel fabrication projects.', '0.00', '0.00', 0, 0, b'0'),
(3, 'Sin Peng Engineering Pte Ltd', 'No.8 Woodlands Walk, Singapore 738397', 'enquiry@sinpeng.com', '199404650N', '-', 'Sin Peng Engineering was established since 1980. We are specialised in Sheet Metal Fabrications, Outdoor and Indoor Cabinets, Casings, electronic Switchboards, Control Panels and customization to customers\' specification. We are an ISO certified company, giving our customers\' quality assurance and confidence.Product and services:\n- Steel Metal Fabrication and Enclosures\n- Electric Switchboard Casting Cabinets\n- Aluminium and Stainless Steel Fabricators\n- Indoor and Outdoor telecommunication Cabinets\n- Semiconductor Equipment\n- Electrical and Control Panels\n- Precision Sheet Metal Works\n- Machine Covers\n- Battery Racks\n- Subracks, TraysStrength and Expertise:\n- CAD / CAM Design\n- Laser Cutting Services\n- CNC Metal Punching\n- Bending & Welding\n- Metal Stamping & Pressing\n- Powder Coating\n- Screen Printing\n- EngravingSin Peng Engineering?s vision and values ? Commitment to Knowledge Training, Information Technology and Market-oriented mindsets. Our staffs are well trained with skill sets to make efficient and reliable use of cutting- edge technology. With our experience and expertise, we are ever-ready to provide quality customer service and build everlasting customer satisfaction.   Business Type :Sheet metal fabrications and semiconductor Country Territory :Singapore Certification :\nISO 9001:2008, MGMT SYS RvA', '0.00', '0.00', 0, 0, b'0'),
(4, 'Sinya Industries Pte. Ltd.', '14 Senoko Cres, Singapore 758268', 'sinya@singnet.com.sg', '199300032N', '-', 'SINYA INDUSTRIES specializes in the following business areas:\n\nComplete lift bare cage, landing door, and car door fabrications\nManufacturing of lift components and parts, including, landing jambs, hall position lanterns/indicators, hall call push buttons, car operating panels,  lift supervisory panels etc\nManufacturing of lift motor room and lift shaft mechanical parts. This includes custom made structural supports and shaft bracketries, landing sills, etc\nDesign and build of new lift cage and interior finishes\nUpgrading, inclusive of design, for existing lift cages and interiors\nDesign and construction of under truss of escalator/travelator with new cladding in the form of sheet metal or alternative finishings.\nIn addition, SINYA INDUSTRIES also provides the following services\n\nFabrication for all manners of steel structures with sheet metal claddings\nProvision of job-shop and cutting services, CNC turret punching, cutting and bending for all kinds of sheet metal finishes\nCustom made sheet metal enclosures, metal cabinets, trolleys, trays, card reader stands, signage displays, metal desks, etc\n\n\nSINYA INDUSTRIES achieves and maintains quality assurance through the practice of two philosophies:\n\nTOTAL CUSTOMER SATISFACTORY by consistently providing reliable, prompt and excellent service at competitive rate, and\nSTRINGENT PROCESS MONITORING which supervises the entire work process flow from raw materials to installation, so as to ensure prime quality at delivery.\nOur team has a combination of extended experience from related industries, with the aim of establishing permanent, long-term relationships, we work hand-in-hand with our clients to maximize their profitability.\n\nSinya Team\n\nSINYA INDUSTRIES is owned and managed by a dedicated team with many years of experience in various industries. With a total team strength approaching one hundred, SINYA INDUSTRIES possesses full capability to provide complete turn-key solutions ranging from design, management, installation, and repairs and maintenance for lifts and escalators.', '0.00', '0.00', 0, 0, b'0'),
(5, 'M Metal Pte Ltd', '5 Kian Teck Drive, Singapore 628822', 'sales@mmetal.com.sg', '200711220M', '-', 'M Metal is a game-changer in Singapore?s building industry, and aims to meet the needs of a growing, and increasingly sophisticated clientele. We are a Singapore-based manufacturer of high-quality steel and non-steel building solutions, providing a comprehensive range of products, with the capability to bring your concept to final completion.\n \nM Metal Pte Ltd is affiliated with established and reputed companies such as Taiwan?s Yieh Phui Enterprise Co. Ltd and Fielders Australia Pty Ltd. Our product-range has been tested and meets local and international standards.', '0.00', '0.00', 0, 0, b'0'),
(6, 'Alliance Panels Pte Ltd', '50A Sg Kadut St 1   Singapore 729353', 'sales@alliancepanels.com.sg', '200811392C', '-', 'As a pioneer and leading manufacturer of sandwich panels, Alliance Panels Pte Ltd provides a comprehensive range of solutions and quality products for all construction and industrial needs.', '0.00', '0.00', 0, 0, b'0'),
(7, 'Anderco Pte Ltd', 'No.3 Tuas View Circuit, LBG Building, Singapo', 'enquiry@anderco.com.sg', '199400384G', '-', 'At Anderco, we always strive to add value to the projects we undertake. By working closely with our clients to understand their exact requirements and tapping on our vast experience in this field, we seek to provide the best possible service. As a turnkey partner, we see all projects through to completion and beyond through services such as ordering fir-out works, after sales repair and maintenance service.\n\nHistory\nAnderco, previously LBG-NGT Corporation, is Singapore?s market leader in temporary housing and facilities. LBG-NGT was incorporated in 2003 with the merger of LBG Container (S) Pte Ltd and NGT Engineering & Construction Pte Ltd. LBG Container (S) Pte Ltd was a container depot operator specialising in container repairs and their conversion to temporary facilities. NGT Engineering & Construction was engaged in the prefabrication of modular housing. The merger brought together over 20 years of combined experience in the design and build of prefabricated and containerised temporary facilities. Today, LBG-NGT has expanded its presence to include Malaysia and Indonesia and is well-regarded for speed, quality and safety.\n\nBrand Story\nSince our establishment in 1988, Anderco?s commitment to deliver safe and well-engineered solutions in the areas of quick-housing and facilities has been steadfast because we realise the positive impact we can bring to the lives we touch ? from the people who live or work in it to those whose lives can be changed for the better because of it (such as in disaster relief). That is why much care and planning is given to every project to ensure quality, timeliness and comprehensiveness. Cementing our commitment to this promise, our name Anderco is anglicised from the pronunciation of our Chinese name ??? which in turn is derived from an abbreviation of our three-pronged value commitment to safety (??), integrity (??) and speed (??). By embracing a pioneering spirit, we are willing to break new grounds and let our passion lead the way. Our growth is a testament to this. Today, our business encapsulates the design and installation of pre-fabricated housing and facilities as well as fabrication of steel structures for turn-key projects.\n\nPioneering Growth\nWith continued dedication to speed, uncompromising quality and dedicated service, Anderco has experienced double digit growth in the past two decades. Today, we continue to move ahead as we chart our growth internationally. Currently we have already successfully built our presence in Singapore, Malaysia, Indonesia, China and Abu Dhabi. Our Clients: Anderco has garnered a growing pool of clients who trust us to deliver timely and quality work, be it standard installations or large-scale projects. Among them are:\nMNCs from oil & gas, marine and construction industries\nGovernment bodies\nIntegrated resorts\nSchools & institutions\nHospitals\nWorld organisations\nRetailers\n\nOur Team & Facilities\nAnderco?s 130,000 sqf headquarters in Singapore houses our manufacturing and warehousing facilities. We employ over 450 staff who ensure every project meets international standards as well as comply with local regulations and requirements. A responsible partner and desirable employer.\n\nEvents\nTo deliver our brand promise, and to deliver it well, we know that a strong and cohesive team is essential to our sustainability and growth. Hence at Anderco, we take care of the well-being of our staff and strive to instil a work life balance culture through our regular events and activities.', '0.00', '0.00', 0, 0, b'0'),
(8, 'Applied Cutting Technology Pte Ltd', '13B Tuas Road, JTC Tuas Road Terrace Factory,', 'sales@appliedcutting.com.sg', '198800468H', '-', 'In 1988, Applied Cutting Technology Pte Ltd pioneered laser cutting in Singapore when it commenced business at Jurong Industrial Estate. We are now located at Tuas Road with bigger production facilities and a brand new machine to cater to the new laser technology.\n\nToday, the company not only provides laser cutting services, but also sheet metal fabrication services. Our customers are from a very diversified range of industries that includes electronic/electrical, automotive, mining, machinery/equipment fabrication, shipbuilding/marine services, interior designing, educational products, furniture and signage among many others.\n\nWe are associated to the Flexmech Group of companies, the solutions people in the machine tool industries.', '0.00', '0.00', 0, 0, b'0'),
(9, 'Lee Metal Group Ltd', 'No. 7 Tuas Ave 16, Singapore 638934', ' \nrandy-lee@leemetalgroup.com', '198205439C', '-', 'A public company since 4 April 2000 and incorporated in Singapore in December 1982\nLee Metal Group is an established distributor and fabricator of steel products as well as a recognized international trader of steel and steel related products in the region. Lee Metal Group employs over 200 employees and has presence in Singapore, Thailand, Malaysia, Australia, and Hong Kong.', '0.00', '0.00', 0, 0, b'0'),
(10, 'Fine Sheetmetal Technologies Pte Ltd', '12 Tuas Link 1, Singapore 638595', 'contact@fsmtech.com', '198002745W', '-', 'Fine SheetMetal Technologies Pte Ltd is a leading manufacturing solutions provider founded since 1979. We are ISO 9001 (since 1995) and 14001 certified (since 2002). We specialize in precision sheetmetal fabrication and machining services. ', '0.00', '0.00', 0, 0, b'0'),
(11, 'G-Tech Metal Pte Ltd', '64 Woodlands Ind. Park E9, Singapore 757833', 'ong@g-tech.com.sg', '200305129H', '-', 'G-Tech Metal Pte Ltd was founded in the 1990s to respond to a need for quality services in the local engineering and construction industry. With more than twenty years of experience today, G-Tech Metal Pte Ltd has grown to become one of the leading companies in Singapore specialising in the design, fabrication and installation of structural steel, metal and concrete work.', '0.00', '0.00', 0, 0, b'0'),
(12, 'Subweld Engineering & Fabrication Pte Ltd', '19 Tuas Ave 4, Singapore 639369', 'admin@subweld.com', '198301243W', '-', 'With more than 30 years of expertise and network in architectural fa?ade industry, SWE has positioned as an institute solution to the outsourcing of Sheet Metal fabrication coupled with Mild Steel Brackets and secondary structure as well as Stainless Steel fabrication.\n\nTogether with the integration of excellent facilities and well-trained dedicated personnel, SWE has excelled to meet its customers? expectations, requirements and specifications', '0.00', '0.00', 0, 0, b'0'),
(13, 'Flows Ong Pte Ltd', '136 Woodlands Ind. Pk. E5 Singapore 757855', 'flowsong@singnet.com.sg', '198800183R', '-', 'Flows Ong was established in 1988 and we have run our business for close to 2 decades. We specialize in employing today\'s most advanced waterjet cutting and cleaning technology to meet the needs of our customers in a wide variety of industries. We are an approved jobshop for provision of high pressure waterjet cutting and cleaning services (ISO 9001: 2008).\n\nCorporate Commitment\nAt Flows Ong Pte Ltd, quality, service and value are the principles by which we have run our business for close to 2 decades. We specialize in employing today\'s most advanced waterjet cutting and cleaning technology to meet the needs of our customers. Our client list includes numerous companies in a wide variety of industries. We are an approved jobshop for the provision of high pressure waterjet cutting and cleaning services. (ISO 9001: 2008).\n\nFlows Ong Pte Ltd has the ability to integrate totally into your existing manufacturing system. When you approach Flows Ong Pte Ltd as nothing more than an extension or group within your own company, that\'s where you\'ll find we really shine.\n\nSuperb Customer Service and Support\nMeeting the needs of each customer, such as handling large or small volumes, warehousing, Just-In-Time delivery and quick turnaround, are all part of our continuing effort to offer the most flexible customer service package possible. You can reduce inventory costs with our Just-In-Time Delivery Service. We\'ll meet your monthly or weekly delivery schedule, so you can assemble your products as you need them. We feature:\n\nFastest Possible Turnaround Time\nReliable And Quick Delivery\n24/7 Service All Year Round\nProducts and Services:\n\nPrecision Waterjet Cutting\nSurface Preparation, Corrosion Prevention and Painting\nIndustrial Cleaning\nCold Cutting\nHeat Exchanger/Tube Bundle Cleaning\nSewer Cleaning\nHigh Pressure Waterjetting Equipment Rental', '0.00', '0.00', 0, 0, b'0'),
(14, 'Shi Huat Hardware Pte Ltd', '69A Joo Koon Circle Singapore 629085', 'sales@shihuat.com.sg', '201523349Z', '-', 'Established in Singapore in 1980, Shi Huat Hardware Pte Ltd is founded by Mr. Lim Chong Hock as a small hardware shop that operates a warehouse space of 400m2. Through our excellence and perseverance, we are now a leading independently-owned industrial marketing organization with more than 14,000m2 of facilities located in Joo Koon Circle. We are one of the largest metal cutting specialists for steel plates products in the country, keeping our stocks to a level of 70,000 to 80,000 tonnes of steel. Thus, we can provide the needs of our customers locally and in other parts of Asia, from small to large quantities of all types of metal cutting services.Shi Huat aims excellence and customer satisfaction by putting all our dedication and hardwork on our craft. Shi Huat is now known as a one-stop procurement centre and a centre for solutions where Metal Steel is concerned.The following are some of the products and services we offer:\n? Metal Cutting Service\n? Skids Fabrication Service\n? Metal Fabrication Service\n? Steel Plate Cutting Service', '0.00', '0.00', 0, 0, b'0'),
(15, 'Thong On Industries Pte Ltd', '11 Gul Street 2 Singapore 629296', 'thongon@singnet.com.sg', '199001235C', '-', 'Thong On Industries Private Limited was established in 1990 and has over 20 years of experience in the engineering sector.\n\nThong On specializes in machining works and customized metal fabrication for various industries such as electronics, construction and chemical etc. Located at 11 Gul Street 2 with a dedicated workforce of over 40 employees, Thong On has a reputation of providing quality services and within budget to satisfy the demands of our customers.', '0.00', '0.00', 0, 0, b'0'),
(16, 'Hock Tiong Ann Hardware Industries & Co', '29 Tuas Avenue 8, Singapore 639244', '', '09254500M', '-', 'Hock Tiong Ann Hardware Industries & CO located in Singapore is dealing with Manufacturing of Machinery, Equipment & Apparatus. \n\nThe Company provide a Metal Cutting Services, trading in hardware products, steel bars, steel plates, stainless steel products and others.', '0.00', '0.00', 0, 0, b'0'),
(17, 'JSL Manufacturing Pte Ltd', 'No 37, Kallang Place Singapore 339165', 'enquiries@jsl.com.sg', '200708949N', '-', 'JSL IS AN ESTABLISHED ENGINEERING COMPANY\nwhere we emphasize in quality product and service to our valued customers since 1991. The business started out in design and fabrication of auto electro-plating and chemical cleaning line. We have shifted our direction to chassis and system fabrication, supporting the semiconductor industry for IC Burn-In-Board and provide engineering solution to reputable pipe fitting suppliers. Over the years, we have extend our services and support customers from other industries including oil and gas, water treatment, marine, energy, pharmaceutical, chemical and food&Beverages.\n\nRead more\n\nOther than machining and sheet metal fabrication department, we have variety of CNC equipment which includes laser engraving, wire-cut, EDM, autolathe and bandsaw cutting. We are equipped to cater specialized processes such as HVOF, lapping, surface grinding and sand blasting.\n\nWe have a strong engineering team to work on development of new process, product implementation and process improvement. With the wide range of customers from various industries, our team work closely and focus on your requirement and develop a solution that fits your application best. Together with our engineering expertise, using our advanced CNC equipment and flexible manufacturing system, we are capable of innovating new product and process technology and work closely with our valued customers.', '0.00', '0.00', 0, 0, b'0'),
(18, 'Leong Seng Metal Pte Ltd', '48 Toh Guan Road East, #03-119 Enterprise Hub', 'enquiries@leongsengmetal.com', '200709455G', '-', 'Established in 1990, Leong Seng Metal has a vast experience in metal fabrication, providing a wide range of services and products customized to customers need.\nFrom simple cutting and bending of metal pieces to building of platforms and gates for factories, Leong Seng Metal has supported many individuals, companies and organizations in meeting their needs and goals.\n\nThere is no limit to our product range or the type of industries we serve. As long as there is a need for a metal product, we are ready to be there to serve you.', '0.00', '0.00', 0, 0, b'0'),
(19, 'HG Metals Pte Ltd', '15 Jurong Port Road Singapore 619119', 'sales@hgmetal.com', '200813123G', '-', 'HG Metal Manufacturing Limited (?HG Metal?) was founded in 1971 as a small retailer of steel products. Today, we are a premier steel stockist and manufacturer with close to 800,000 sq ft of state-of-the-art warehousing facilities in Singapore.\n\nWe offer a ?one-stop? end-to-end solution for our customers, ranging from distribution services to downstream and value-added activities. Equipped with strong sourcing capability from an extensive network of suppliers from countries such as China, Japan, Korea, Turkey, Russia, Ukraine, and other Eastern European countries, we carry more than 3,000 types of steel products, of various dimensions and for a wide range of industries and applications. We also offer customised steel solutions for diversified industries including energy, transportation, marine, electronics and other sectors.\n\nThrough our three main business units ? HG Distribution, HG Construction Steel and HG Industrial Steel & Services, we provide:\n\nOne-stop supply and just-in-time production for all construction steel requirements, including cut and bend deformed bars and plates rental;\nCompetitively priced and extensive product portfolio for all industries;\nTailored solutions and complete range of processing services such as high precision slitting and shearing, CNC profile cut and surface protection; and\nFlexible commercial packages such as blanket orders, rental options and credit accounts.\nToday, HG Metal has about 1,000 customers from diversified industries, who are located predominantly in Singapore, Myanmar, Malaysia and Indonesia. We also export on a smaller scale to Sri Lanka, Brunei, Thailand, Vietnam, New Zealand, Australia and Papua New Guinea.\n\nHG Metal was listed on Singapore Exchange?s former junior board, SESDAQ, on 21 March 2002 and was upgraded to the mainboard in May 2004.', '0.00', '0.00', 0, 0, b'0'),
(20, 'Quick Master Techniques Pte Ltd', '11 Tuas View Loop Singapore 637677', 'enquiry@quickmastercps.com.sg', '200404885K', '-', 'Quick Master Techniques Pte Ltd (?QMT?) was established in Singapore in 2004. QMT employs a total number of more than 20 employees in Singapore.\n\nQMT is specialized in the following areas:\n- Design, fabricate and supply CNC retrofit and custom made machines for both Gas & Plasma Machines; \n- Engineering, metal fabrication works, gas piping and CNC milling;\n- CNC tube panel welding; and\n- Providing high quality profile cutting services. \n\nQMT manufactures a full product line of CNC Gas and Plasma Machines and offers expert after-sale services.\n\nOver the years, QMT has gained many years of project involvement experiences with major shipyards such as Keppel Fels and PPL in building of Class Jack-up Rigs, Semi-submersible Drilling Rigs and etc. \n\nWhether you desire a new CNC Oxygen, Plasma Cutting Machine, or retrofit your current flame cutting machine to your own customized machine, we are confident that we can produce an integral solution that meets with your requirements and budget. Our ultimate and prime goal is to provide customers with the highest quality cutting equipment and service in Asia with a competitive price.', '0.00', '0.00', 0, 0, b'0'),
(21, 'Richinn Technology Pte Ltd', 'No.3 Joo Koon Crescent, Jurong Industrial Est', 'SALES@RICHINN.COM.SG', '200204697H', '-', 'Richinn Technology is formed in 2004 to provide enhanced business solution for sheet metal processing to various industries. Our business strategy is to deliver high quality sheet metal parts within the shortest turnaround time.\n\nThis will help to improve productivity for our customers, thus cost saving.\n\nWe have leveraged on the state-of-the art technology in managing its operations while providing top-notch customer care. With the investment of the state-of the-art laser cutting machines and waterjet cutting machine, Richinn Technology is not only able to meet our customers\' needs better, but helps to increase prospective customers\' workflow & productivity.\n\nAs a result, our customers will be able to offer their clients high quality finished products & timely delivery at reasonable price.', '0.00', '0.00', 0, 0, b'0'),
(22, 'Seng Leong Project Pte Ltd', '12 Tuas Basin Link, Singapore 638764', 'sengleongproject@gmail.com', '200103841H', '-', 'Seng Leong Project Pte Ltd has come a long way since its incorporation in 2001. Over the years, we have proven ourselves to be one of the recognised leading steel structure fabricators in Singapore.\n\nToday, Seng Leong Project have the capacity to take on major projects from diverse field in public, institution, housing and commercial building sectors .\n\nWe house a wide range of machineries  for steel fabrication and metal fabrication, and are capable to provide wide range of services. With our strength, we are able to cater for all yours need in process, design and quality outsourcing arrangement to provide ancillary needs in steel structures industry.\n\nOur Beliefs\n\nTo Provide excellent customer services and to attain customers utmost satisfaction and requirement\nContinuous advancement with technology for quality and productive works\nTo Offer excellent and cost effective solutions to customers\nOur Strength\n\nOne stop for all engineering and steel fabrication solutions\nDirect in house experienced and qualified workforce for steel fabrication and erection works\nFully equipped fabrication facilities to cater for all type of steel sections and parts processing', '0.00', '0.00', 0, 0, b'0'),
(23, 'Sin Hong Huat Aluminium (Pte) Ltd', '22 Defu Lane 7, Singapore 539343', 'enquiry@sinhonghuat.com.sg', '197602598C', '-', 'Sin Hong Huat Aluminium (Pte) Ltd. was established in 1976, with more than 39 years in aluminium business. \n\n Stockists & Agents\n\n Wholesales & Retails\n\n Import & Export\n\n Sales & Distribution\n\n Aluminium Service Center', '0.00', '0.00', 0, 0, b'0'),
(24, 'Sing Chow Metal Works (Pte) Ltd', '56 Defu Lane 1 Singapore 539497', 'scmwpl@singnet.com.sg', '197501206C', '-', 'Sing Chow Metal Works (Pte) Ltd specializes in Laser Cutting, Turrect Punching, CNC Bending, Metal Fabrication, Stainless Steel Fabricators, Hinges, Metal Cutting Service, Steel Bar Bending & Cutting Service, Sheet Metal Specialties, Metal Bending Service, and Steel Errectors.', '0.00', '0.00', 0, 0, b'0'),
(25, 'Siong Ann Engineering Pte Ltd', '61 Joo Koon Circle, Singapore 629074', 'info@siongann.com', '198804718N', '-', 'Established since 1988, Siong Ann Engineering Pte Ltd started it?s business being a steel structures fabrication workshop and specialising in conveyor systems, has over the years evolved and grow steadfast together with current markets demands. We are now an industry leader and specialist in the theatre and studio engineering, bulk-handling systems, steel structural works, design and build company. We are located in 61 Joo Koon Circle, with a manpower of up to 80 staff, having our own in-house design and project management team, equipped with a rich experience in mechanical and electrical engineering, fabrication and assembly capabilities, site installation experience, logistics planning and delivery, system testing and commissioning, system maintenance, logistics management, spares supplies, storage and handling facilities.', '0.00', '0.00', 0, 0, b'0'),
(26, 'Soon Huat Heng Metal Industry', '69B Joo Koon Circle, Singapore 629086', 'shhmi@singnet.com.sg', '46548100X', '-', 'Soon Huat Heng Metal Industry started her business in the 1980s. We were then located at Penhas Road where we first started out as an oxygen acetylene cutting service company. As the industry evolved, our company also engaged in plasma cutting services. Our company grew and we decided to further diversify our business where we subsequently moved to Ang Mo Kio Industrial Park. We started welding consumables supplies in the 1990s. \n\nWe first brought in a Taiwanese brand Kuang Tai Metal Industries as our welding electrodes manufacturer. Later we were awarded as the sole agent for AvestaWelding welding consumables in Singapore. We also began to supply welding, plasma cutting and portable gas cutting machines. Our technical department had tested out a couple of brands in the market and decided to concentrate on a few brands, inclusive of HeroPower Technology and Wel & Cut.\n\nDue to the lack of factory space for our expanding business, we shifted from Ang Mo Kio Industrial Park to our present location, Jurong Industrial Estate, Joo Koon Circle in the year 2002.\n\nAs we stepped into the new millennium, our company decided to concentrate and venture into a new form of cutting services; high pressure waterjet cutting. Waterjet cutting allowed us to provide our customers with a better edge quality finish cutting. Oxygen acetylene cutting and plasma cutting services were slowly phrased out from our business focus. We subsequently brought in two waterjet machines to cope with the ever increasing demand of high quality finish cutting.\n\n\n\nOur Vision:\nTo provide various methods of cutting services and supply all welding needs under one roof\n\n\n\nOur Promise:\nTo deliver excellent cutting services and offer competitive pricing for our products', '0.00', '0.00', 0, 0, b'0'),
(27, 'Sunny Metal & Engineering Pte Ltd', '35 Changi South Ave 2, Sunny Industrial Build', 'sales@sunnymetal.com', '198301973W', '-', 'Sunny metal & engineering was founded in 1974 with the simple cutting tools and few workers, to fabricate sheet metal products largely demanded by the construction industry. Over the year, it has grown to become one of the leading companies to provide sophisticated solutions for electronic consoles, 19? racks, wall mounted cabinets, and many other types of high-end enclosures including those with special climate and/ or noise control. To date, we have built up a strong team of experienced engineers who are able to work independently and closely with our customers to solve any designs issues. Our skilled workforce, supported by a solid manufacturing infrastructure of advance machineries and equipments, are able to handle the most challenging sheet metal metal production. Our relationship with our suppliers and business partners are strongly founded on long term trust, and they have been contributing significantly to our quality and short delivery schedule committed to our customers. Most importantly, we have many customers who have stayed and work closely with us for long term. Moving forward, we seek to work closer with our customers to understand their needs and continue to provide speedy and sound solutions at affordable price.', '0.00', '0.00', 0, 0, b'0'),
(28, 'Van Joo Industrial Engineering Pte Ltd', '7 Tuas View Loop, Singapore 637673', 'enquiries@vanjoo.com.sg', '200102407H', '-', 'Van Joo Industrial Engineering Pte Ltd is renowned for its quality and designs in its products and services. The distinctive standard of its products has enabled Van Joo to steadily meet and achieve industry standards.\n\n? Cable Support System\n? Cable Ladder & Accessories\n? Perforated Cable Tray & Accessories\n? Cable Trunking & Accessories\n? Channels\n? Welding & Rolling Services\n? Cutting & Bending Services\n? Turret Punching Services\n\nVan Joo?s operations include raw materials like:\n- hot-rolled mild steel\n- aluminum\n- stainless steel\n- pre-galvanized steel\n\nVan Joo Industrial Engineering Pte Ltd also provides finishing services like electroplating, hot-dip galvanizing, special painting, and powder coating.\n', '0.00', '0.00', 0, 0, b'0'),
(29, 'Zoom Engineering Pte Ltd', '68 Senoko Road, Singapore 758128', 'zoom@zoomengrg.com.sg', '200512028Z', '-', 'Running Since 1993\nZoom Engineering Pte. Ltd. has been established in 1993, since then we are growing substantially throughout the years.\n\nThe core businesses of Zoom Engineering Pte. Ltd. are manufacturing, fabrication and designing of steel products.\n\nOur Professionalism\nZoom Engineering Pte. Ltd. is the preferred vendor of many companies, dealing with fabrication and manufacturing of Enclosure Sets, Canopies, Steel-based frames, Acoustics Attenuators, Exhaust Mufflers, Fuel Storage Tanks, Control Panels and customized components.\n\nTo-date, we have expanded significantly in scale and resources to provide better service and support to our customers. We have our in-house Laser Cutting, CNC Plasma, Punching and Milling, Bending, Plate Rolling and Certified Welders to support the industries.\n\nOur team of engineers work hard together to provide each of our trusted partners and clients the best output that no other engineering companies can offer.', '0.00', '0.00', 0, 0, b'0'),
(30, 'KJW Fabrication & Services Pte Ltd', '17B Joo Yee Road, Singapore 619203', 'sales@kjwfs.com.sg ', '199307569R', '-', 'Company Profile\n\nKJW Fabrication & Services Private Ltd was established in 16th November 1993 with the goal of providing customers and the community as an innovative and value oriented manufacturer.\nWe have a group of talented and skilled team to meet the needs for high precision engineering products. Our responsible, dedicated and customer oriented work force is the key in keeping existing customers at the same time attract new ones.\n\nThis is to upkeep our motto:\" WE DO OUR BEST\".\n\nAbout Us\n\nWe have vast experience in the fabrication, machining, welding and repair industries, giving our customers the edge in today\'s fast paced environment.\n\nWe have regular clients that trust us for our good quality products and speedy response to their needs.\nDoing our best is the main reason in our survival in this market. We believe in mutual trust with our clients and give every customer the special attention they require from us.\n\nOur machining capabilities have further strengthened in the recent years (2009-2010) with the acquisition of 2 new machines. This include a vertical lathe machine model CQ5250 and a boring machine model TX6213.\n\nOur heavy duty vertical lathe capacity has a swing over of 5000 mm and maximum work piece height of 2500 mm. The maximum load on the rotary table is 32 Tons. With the boring machine and a separate 2500 x 3000 mm rotary table (20 Tons capacity) will give us the versatility and an additional competitive edge to take up large scale jobs. The Jobs may require grooving, drilling, boring of large holes and face machining of work pieces that require post machining after welding processes. Our dedicated team will be delighted to assist in all your machining needs. \n\nOur Vision\n\nWe will be recognized as one of the most trustworthy and responsive company in providing the best services in the market.\n\nOur Mission\n\nTo provide the best services within the minimum stipulated time.', '0.00', '0.00', 0, 0, b'0'),
(31, 'Leong Jin Corporation Pte Ltd', '11 Benoi Crescent, Jurong Industrial Estate, ', 'sales@leongjin.com.sg', '197400024R', '-', 'An Elite Provider of Steel\n\nFounded in 1971, Leong Jin Corporation has matured from being a purveyor of steel to becoming a premier name within the global steel industry. We pioneered the expertise of acquiring a comprehensive range of special steel and strive for prompt, efficient deliveries. Leong Jin Corporation is now a specialist, a one-stop procurement centre, and a place for special steel solutions.\n\nWidening our product offerings to include an extensive range of services like forging, state-of-the-art cutting and pre-machining, we believe in providing our customers convenience with a one-stop-shop solution. Together with our business partners and customers, we support a strong focus on quality control and safety at all times. Leong Jin Corporation has also achieved International Organization for Standardization (ISO) certifications, namely ISO 9000:2008, ISO 140001:2004 and OHSAS 18001:2007.', '0.00', '0.00', 0, 0, b'0'),
(32, 'Leng Huat Steel Pte Ltd', '10 Gul Road, Singapore 629342', 'lenghuatsteel@singnet.com.sg', '200800333C', '-', 'Leng Huat Steel Supplies was incorporated in 1983, setting itself as a one-stop sheetmetal service centre. Our company focuses on steel forming and metal works tailor-made to clients? specifications suitable for use in construction, shipbuilding, mining and other engineering industries.\n\nWe have since expanded our operations to include Leng Huat Steel Pte Ltd as our subsidiary in 2009.\n\nTogether, the Leng Huat Steel Group has for the past 30 years and longer, established a reputation for excellent quality and fast completion of job requests and projects with our clients.\n\nOur factories house a number of high-performance CNC machinery including 3-pin roller, press brake bender, sectional roll and guillotine shear to process and value-add to a wide range of sheet metal engineering products for various heavy industries. These are suitable for a multitude of metal types, up to 50mm thickness and 6.1 metres (20 feet) length plate sizes. Materials we deal with include but are not limited to carbon steel, stainless steel, aluminium, copper and special steels such as Hardox, Domex, Optim, Reax, Quard, Quend, etc. \n\nLeng Huat Steel is also the exclusive producer of sheared and straightened, custom sized steel flat bars.\n\n\nSome of the products and services we offer include:\n\nShearing and Straightening of various cut-to-size plate sizes\nBending (channels/trays/angle bars/pipe clamps)\nRolling (plates/pipes into arcs or full circles)\nAngle bar Leg-in/Leg-out rolling\nRolling of flats on edge / flat bar (hard way rolling)\nCorrugation & Crimping\nDevelopment & Forming of reducer cones, transition or elliptical pieces, elbows & chutes\nShearing, rolling and/or progressive bending of cylinders, pipes, rings and casings\nCutting and rolling of rods and loops\nGas-cutting, hole-punching and fibre-cutting services\nWelding works\nRush order services are also available at competitive rates\n\n', '0.00', '0.00', 0, 0, b'0'),
(33, 'Joo Lee Engineering Pte Ltd', '42 Sungei Kadut Street 1, Singapore 729346', 'sales@joolee.net', '200800268Z', '-', 'Joo Lee Engineering Works is founded in 1978 however, we have shift our operation to Joo Lee Engineering Pte Ltd in 2014. Joo Lee Engineering Works manufactures high quality furnishings and equipment that are economically and ergonomically friendly. Our specialization lies in metal forming, fabrication, machining, welding and other repair industries. With our wealth of experience and expertise, we strive to complete projects in the shortest time frame possible. \n\nWe take pride in our team of motivated staff, who in turn create products of excellence to fit the needs of each individual customer. Aside from manufacturing products like stainless steel tables to certified offshore containers and cable bridges, we also provide modification services for machines, to maximize production while saving cost. \n\nMake an enquiry with our friendly staff today and bring life to your engineering blueprints.', '0.00', '0.00', 0, 0, b'0'),
(34, 'Formach Asia Pte Ltd', '514 Chai Chee Lane, #03-12, Singapore 469029', 'sales@formachasia.com', '200702496N', '-', 'Formach Asia was founded in Year 2000 with a Commercial Office located in Singapore and a Manufacturing Plant located in Southern Johor, Malaysia.\n\nFormach Asia provides sheet metal, precision mechanical structure fabrication, CNC component machining, full OEM electro-mechanical assembly services and solutions to customers in High Mix ? Low Volume manufacturing which essentially targets the market Leaders in the equipment and machine makers in the industries.\n\nOur valued clients are largely from Europe and the US with operating subsidiaries and IPO in Asia. Leveraging on the experiences of our people, market exposure and technology knowhow, we are well positioned to understand and meet the needs of these MNC clients.\n\nWe are able to maintain cost competitiveness as majority of the manufacturing is carried out in-house thus enabling us to better control our Quality and Delivery. Our manufacturing plant is also strategically located in Johor, Malaysia to take advantage of Low Cost.\n\nOccupying a floor space of 90,000 sq ft, the factory is well equipped with machinery, Robotic Welding workcell, a fully pledged QC measuring equipment and controlled environment for assembly services.\n\nThrough continuous learning and skillset improvement, Formach Asia aims to be the choice partner in helping customers grow their businesses with high product Quality and Reliability at lower manufacturing cost.', '0.00', '0.00', 0, 0, b'0'),
(35, 'Ong Kian Hin Iron Works Pte Ltd', '43 Senoko Way, Singapore 758054', 'sales@okh.sg', '199100074Z', '-', 'Ong Kian Hin Iron Works specializes in sheet metal customisation and fabrications for industrial and residential sectors. With many years of experience, our business has expanded over the years to provide full engineering support to meet the diverse needs of end consumers and industrial clients.\n\nToday, our company has a team of experienced and highly skilled fabricators, working to provide our clients with a wide range of metal and iron engineering related works and products.\n\nTo keep abreast of technological advancement, we have invested heavily in advanced equipment over the years. Our equipment include: CNC punching machines, CNC bending machine, CNC laser cutting machine.', '0.00', '0.00', 0, 0, b'0'),
(36, 'Pve Metal Engineering Pte Ltd', 'Blk 2021 Bt Batok St 23 #01-216 Singapore 659', 'ttlim@pvemetal.com.sg', '200503144N', '-', 'PVE Metal Engineering Pte Ltd (PVE), incorporated in Singapore in year 2005, is totally committed to our customers? needs by providing products and services in meeting or exceeding their expectation in both quality and manufacturing standards.  With the present and future highly competitive nature of this segment of the market, we have created several systems, one of which is our Flexible Manufacturing System (FMS), to better manage our growth and meeting customers\' constant changing demands.\n\nWith FMS, we manage to serve our clients better in terms of lower cost on various types of product manufacturing with high complexities.  In addition, we strive to provide technical assistance, solutions, processes and material management expertise to meet clients? requirements for product quality and on-time delivery with extremely short lead time allocation.\n\nWhere there is a need for process automation, we work with our clients\' operational and engineering teams to design, build, test and commission automated systems to meet their production daily throughput and quality requirement.\n\nIn short, PVE Metal Engineering is here to serve all your engineering requirement while innovate and simplify your key manufacturing processes to reduce cost, improve your product quality, work and environment safety which ultimately translate to adding values to your products and services.', '0.00', '0.00', 0, 0, b'0'),
(37, 'AME International Pte Ltd', '3 Joo Koon Circle, Singapore 629032', 'sales@ame-st.com', '200605569H', '-', 'AME International Pte Ltd is a leading steel engineering company in Singapore. We specialise in Precision CNC Machining, Design, Fabrication, Assembly and Installation of structural steel works for the Shipbuilding, Oil & Gas and Construction industries. Besides these, we also provide sheet metal/ precision structural steel works for the Semi-con and other related Business Sectors.In August 1996, the business started as Automated Machinery & Equipment. It was then privatised as a limited company in April 2006 and renamed as Automated Machinery & Equipment Pte Ltd. After further developments, both in our range of activities and continual increase in turnovers, the company in September 2007 was then incorporated with additional capital to become what it is known as today.We are certified for both ISO 9001 and OHSAS 18001. As your business partner, it is our aspiration to provide you with products / services that will surpass your most stringent specifications.', '0.00', '0.00', 0, 0, b'0'),
(38, 'Metform Industries Pte Ltd', '23 Woodlands Terrace, Singapore 738472', 'thtan@metform.com.sg', '198202136R', '-', 'Metform Industries Pte Ltd was established in 1982 . The main activity then was the fabrication of sheet metal products metal door frame. The objective was to capitalize on the introduction of metal door frame to the HDB projects.\n\nMetform was listed as one of the approved supplier on the HDB List of  Approved Supplier in 1993. Details of approval can be viewed @ http://www.HDbuilders.com\n\nTo sustain growth , Metform Industries diversified into the industrial sector market in 1987 by investing in sophisticated machineries and offering our services to companies like Uniysis, Makino, Fujitec and etc. for the production of their precision sheet metal parts and components\n\nIn 1992 Metform Industries expanded into the private building sector offering a range of fire rated products such as Hoppers and fire rated Doors.\n\nIn 1997 Metform Industries diversified into the manufacturing of metal cable support system complying with Singapore Standard SS 249 for Steel Cable Trunking and Accessories.\n\nIn addition Metform Industries also possess  precision machining capability. This capability not only enhance our sheet metal manufacturing capability but also provides us opportunities to expand into new sector.\n\nWith the addition of two coating facilities, i.e. Cathodic Electro Deposition(CED) in 1991 and Epoxy Powder Coating in 1998, we are certainly one stop closer towards our commitment to offer a comprehensive metal fabrication service to our valued customers.\n\nAwards & Certifications\n1) Registered with Singapore Construction Industries Development Board (CIDB) under the  work Heading SY O3 , Grade L4 and CWOI , Grade G1 which qualify the company to tender Windows Frame & Glazing works of up to S$5 million and General Building works of up to S$500,000 respectively.\n\n2) In the manufacturing of  Sheet Metal Products, Metform Industries were certified to the ISO 9002-1994 Standard in 1999 by the Singapore Productivity and Standard Board (PSB) and was successfully upgraded to the ISO 9000-20000 version in 2001.\n\n3) Metform?s two surface coating facilities, i.e. Cathodic-Electro Deposition(CED) Coating and Powder Coating process were also successfully certified to have achieve the ISO 9000 2000 in year 2001.\n\n4) Steel Surface Cable Trunking and Accessories manufactured by Metform was certified to comply with SS 249 Standard and are listed in PSB \'s product Listing Scheme (PLS) under Class 1A in year 2000. This product was listed in the PLS under the name of EM Industries Pte Ltd which market this products.\n\n5) Fire rated Hopper Door manufactured by Metform Industries Pte Ltd, marketed by GP  Global  Pte Ltd, was successfully listed in the PSB\'s Products Listing Scheme under Class 1A category in year 2002, being the first company to list this product in this  category', '0.00', '0.00', 0, 0, b'0');
INSERT INTO `m_company` (`Id`, `Name`, `Address`, `Domain`, `Reg_No`, `Code`, `About`, `SupplierAvgRating`, `BuyerAvgRating`, `AwardedQuotation`, `SubmittedQuotation`, `IsVerified`) VALUES
(39, 'Premplas Technologies Pte Ltd', '2 Woodlands Sector 1, #03-18, Woodlands Spect', 'sales@premplastech.com', '200501387N', '-', 'Premplas Technologies is a leading one-stop engineering solutions company in Singapore.\n\nFounded in 1996, we have rapidly gained customer confidence in our products and services and has thus developed and grown into a comprehensive one-stop engineering solutions company specializing in Precision Machining & Automation, Precision Sheet Metal & Frame Structure, Engineering Plastics Fabrication, Thermoplastic Welding and Facilities Maintenance. Our production facilities in Singapore have an area of 50,000 sq ft.\n\nManaged and led by a team of experienced and highly dedicated people coupled with an efficient and skilful workforce with our relentless efforts at achieving high quality through constant training and upgrading of machineries. Premplas Technologies has become a recognized name for superb quality and excellence in the engineering industries. ', '0.00', '0.00', 0, 0, b'0'),
(40, 'Y.H.H Manufacturing Pte Ltd', '15 Gul Link, Singapore 629385', 'enquiry@yhh.sg ', '200820971N', '-', 'Y.H.H Manufacturing was established in 2008. We are a technology driven manufacturing business that is committed to both product and service quality.\n\nOUR MISSION\nTo be a Total Solutions provider for all the Metals needs that deliver beyond expectations.\n\nOur team of elite engineers coupled with their outstanding skills and experience has enabled us to provide our clients with customized cost - effective solutions that go a long way.', '0.00', '0.00', 0, 0, b'0'),
(41, 'Lew & Lee Engineering Pte. Ltd', '8A, Tuas Avenue 13, Singapore 638981', 'sales@lle.com.sg', '198904293M', '-', 'Lew & Lee Engineering Pte Ltd was established in 1980 and has been a specialist one stop provider of CNC Metal Plates Profile Cutting Services since 1996.\n\nCompanies such as structural steel fabrication, constructions, heavy machines manufacturing, shipbuilding, oil & gas and other related industries have been continuously engaging to our services, as our services help our customers enhancing their productivity, time and costs.\n\nIn order to meet our customer expectations and improve in quality, Lew & Lee Engineering Pte Ltd is ISO 9001 and Bizsafe 3 certified since 2012 and a roadmap to ISO 14001 and Bizsafe 4 is in a process of planning.\n\nOur Company Setup:\n\nCNC Oxy-fuel Cutting Machines: 4 Units\nCNC HD Plasma CNC Cutting Machines: 3 Units\nCNC Oxy-Fuel/Plasma Pipe Cutting Machines: 1 Unit\nCNC Metal Drilling Machines: 1 Unit\nPneumatic Metal Tapping Machines: 1 Unit\nPortable Electronic Marking Machines: 1 Unit\nOur Capabilities:\n\nMax. plate size for cutting: 10ft x 40ft plate size\nMax. plate thickness for cutting: 400mm thick\nMax. plate size for drilling: 10ft x 30ft plate size\nMax. plate thickness for drilling: 100mm thick\nMax. drilling bore: 50mm diameter\nMonthly capacity for metal plates cutting: < 1,000 tons of metal plates / month', '0.00', '0.00', 0, 0, b'0'),
(42, 'ENV-PRO Tech Engineering Pte Ltd', '12 Pioneer Sector 1, Singapore 628423', 'envpro@singnet.com.sg', '200414748R', '-', 'Welcome to ENV-PRO TECH ENGINEERING PTE LTD\nA solution provider for Oil and Gas, Energy and Process Industry. We have the capability and resources to undertake challenging projects with International Oil Companies and Contractors world-wide.\n\nEnv-Pro Engineering Tech Pte Ltd was incorporated in 2004 after taking over the fabrication workshop and machinery of an existing local steel fabricator, which provides engineered equipment and integrated engineering services primarily to both Onshore / Offshore Oil & Gas and Process Industry as well as the General industry.\n\n \nTK Engineering Pte Ltd\nIn March 2012, TK Engineering Pte Ltd became the subsidiary of Env-Pro Tech Engineering Pte Ltd, it specialises in metal machining and service & repair of mechanical part.\n \nOur Capabilities\nEnv-Pro Tech has the capability to offer complete proven products and services and individual cost effective solutions and engineering services to meet customer\'s specific operating requirements.\n\nEnv-Pro Tech has expanded its capabilities as fabricator of Process equipment to Engineering, Procurement Construction & Commision (EPCC) Turnkey Projects including design and supply of Separators, Oil & Gas Processes and Equipment, Metering Systems etc.\n\n \nOur People and Facilities\nEnv-Pro Tech highly experienced and competent team of professionals is capable of handling engineering projects. Our flexibility and ability to provide timely deliveries are ensured by allocating experience resources to manage our customers\' projects.\n\nOur team of expertise which have accumulated more than 20 years of project experience are proud to offer our professional services to actively involved in the design and supply of Pressure Vessels, Production equipment and Modular Process Packages to customer specifications, statutory requirements for Onshore and Offshore installations worldwide.\n\n \nMission Statement\nEnv-Pro Tech aims to give our customers excellence in service and product performance with optimum value. We will always use the highest standards of business integrity in our dealings with you.\n \nVision Statement\nEnv-Pro Tech aspires to be the global Engineering & Fabrication Provider for the Onshore / Offshore Oil & Gas Industry.', '0.00', '0.00', 0, 0, b'0'),
(43, 'Farron ship repair & engineering pte ltd', '8 TUAS LINK 2, SINGAPORE 638557', 'sales@farronengineering.com', '199000861G', '-', 'Farron ship repair & engineering pte ltd (Singapore) has been providing custom metal fabrication services & engineering solutions for various industries since 1990. We pride ourselves at being efficient and professional in meeting the different demands of our clients.\nMilestones\n1990 - Farron ship repair & engineering pte ltd has been incorporated in Singapore since 1990. \n                       It has since served numerous satisfied clients, providing them with custom engineering solutions.\n2002 - Became a statutory member of the Singapore Business Federation.\n2011 - Attained BizSAFE level 3\n2011 - Attained BizSAFE level 4\nMission statement\nOur mission is to provide quality services that consistently meet our clients\' needs and expectations through excellence in our operations. We aim to deliver fast and efficient engineering solutions to all our clients.\n\nSafety\nThe company believes in establishing and providing a safe work environment, and participates regularly in safety programs & seminars such as BizSAFE. \n\nThe Workplace Safety and Health Act (Risk Management Regulations) was introduced by the Ministry of Manpower in September 2006. Under the law, all employers, the self-employed and principal (including contractors and sub-contractors) are to conduct risk assessments and implement risk management at their workplaces to control hazards and reducing risks. The act will cover all workplaces in Singapore with effect from September 2011. \nFARRON SHIP REPAIR & ENGINEERING PTE LTD is proud to attain the certification of BizSAFE Level 3 on 24th August 2011.\nFARRON SHIP REPAIR & ENGINEERING PTE LTD is proud to attain the certification of BizSAFE Level 4 on 13th October 2011.', '0.00', '0.00', 0, 0, b'0'),
(44, 'Rolled Alloys Singapore, Ltd', '61 Tuas South Avenue 1, Singapore 637554', 'onlinesales@rolledalloys.com.sg', 'T00FC5968D', '-', 'Our Vision: Winning in the specialty metals business by creating excellence through our people.\n\nOur Mission: Exceeding the expectations of specialty metals customers worldwide to the mutual benefit of our people, customers and suppliers.\n\n\nRolled Alloys Singapore is a leading supplier for all your specialty alloy needs (nickel-based, stainless steel and titanium).\n\n\nWe were established in 2000 and started operating as a sales office servicing all countries in the Asia Pacific, Australasia, India and Middle East Regions.\n\n\nIn November 2007, we opened a stocking and processing facility in the Tuas area on the far west side of Singapore. The facility was focused on stocking round bars and welding consumables of various grades.\n\n\nAfter various expansions over the years in both inventory and processing equipment, Rolled Alloys Singapore moved to its current facility in February 2014. Operating from Tuas South Avenue 1, Rolled Alloys Singapore?s current facility is 20,000 sq ft. Since opening in 2014, Rolled Alloys Singapore have already invested in additional processing equipment (High Speed Cold Saw) and have recently installed a pan racking system to improve/increase the storage capacity of round bars. Further improvements are planned going forward. This new facility allows Rolled Alloys Singapore to provide a faster service to our customers in the region and increase our overall footprint. Rolled Alloys Singapore is proud to operate one of the most efficient bar service centres based in South East Asia.\n\nCommitment to Service\nRolled Alloys is committed to quality service for our customers. The hallmark of our success has been superior customer service, with a staff of salespeople, metallurgists, and quality control professionals to support the needs of our customers. We stock a large variety of alloys and have extensive processing capabilities, both of which enable us to provide prompt shipment of stock size material and custom cut parts.\n\nProduct Line\nRolled Alloys has an extensive inventory in plate, sheet, bar, pipe, fittings, and welding materials are maintained in heat resistant,corrosion resistant, and high temperature alloys. All products are purchased to proprietary customized specifications as well as normal industry standards.\n\nCommitment to Technology\nRolled Alloys is a technically focused organization. Today, a staff of degreed engineers provides our customers with technical expertise in a broad range of applications, helping solve customer\'s problems on a daily basis. Our extensive laboratory capabilities permit material evaluations, including selective destructive testing.\n\nCommitment to Quality\nRolled Alloys is committed to quality and was one of the first metal suppliers to achieve ISO 9001:2000 certification. We are also AS9120 certified and AS9100 certified.\n\nMarkets and Applications\nRolled Alloys provides material to the heat treat, thermal processing, chemical processing, power generation, aircraft/aerospace, pollution control, waste incineration, pulp and paper, food processing, and pharmaceutical markets.\n\nProcessing Capabilities\nRolled Alloys provides complete cutting and processing services which include: laser cutting, waterjet cutting, plasma burning, shearing, gauering, rod coil leveling, sheet leveling, and saw cutting\n\n', '0.00', '0.00', 0, 0, b'0'),
(45, 'Systematic Engineering Pte Ltd', '27A Jurong Port Road, Blk 3, #01-39/40/41, Si', 'info@systematicengrg.com.sg', '198701892M', '-', 'SYSTEMATIC ENGINEERING PTE LTD was Established and Incorporated in Year 1975 and 1987 accordingly with Subsidiaries in Jiangsu ? Wuxi, China.\nSystematic (Wuxi) Engineering Co. Ltd\nNanjing Nanfeng Engineering Co. Ltd.\nOver the past 41 Years, our company had transformed from a Humble Mechanical Workshop into an Establishment which is capable of providing Engineering Designs, Fabrications and Constructions of various :-\n\nStorage Tanks,\nPressure Vessels,\nEquipment Process Modules / Skids,\nStorage / Mixing Tanks and Silos,\nNew Plant Design, Setup and Installation,\nPiping Fabrication,\nSteel Structure and Platforms,\nOffshore and Onshore Facilities,\nFood Process Handling Equipment,\nMaterial Handling Equipment.\nOur workshop is equipped with a wide range of Facilities consisting of:\n\n100 & 200 Ton Hydraulic CNC Press Brakes,\n16mm X 3.0m (L) CNC Power Shear,\n16mm X 3.2m (L) CNC Power Blender,\n3.0m X 12.0m (L) CNC Oxy-Acetylene / Plasma Cutting Machine,\n4.5m ? X 4m (L) 1000Amp Automatic SAW,\nTungsten Inert Gas Welding Machine,\nManual Inert Gas Automatic Welding Machine,\nWelding Transformers,\nPillar Drills,\nHeavy Material Handling Equipment.\nOur Machine Shop, with Highly Experienced Machinist, is capable of machining up to an accuracy of 10 micron and our Machining Facilities consist of :-\n\nLarge Turning,\nShaping,\nMilling,\nRadial Drilling Machine,\nBoring,\nLathe Machine.\nOur Design Section is supported by the Latest Computer Aided Design And Drafting Equipments and Latest Software In Plant Design Technology ? 3D Plant Design and PV Elite Software for Pressure Vessels Design to all International Standard.\n\nWith a workforce of 30 comprises of highly qualified design and project engineers supported by skilled technician and craftsman having many years of experience in the field of engineering that had enable us to provide high quality products and services to hundreds of satisfied customers.\n\nTogether with the support of our Suppliers, we will continue to strive and work together for a long lasting and mutually Beneficial Partnership with all our Customers.\n\nOur Support\nOur Excellent Relations with our Experienced Contractors means that we can provide Turnkey Solutions to our Customer in the field of:\n\nElectrical Works,\nCivil Works,\nErection Works,\nInstrumentation Works,\nInsulation Works.\nWe purchase our items from reliable sources; these suppliers themselves whom are major players in the market had played an important role in the quality of our products. Through them, we are able to give Certified Items and Equipments such as:\n\nValves,\nGear motors,\nPumps,\nInstruments & Controls,\nPiping & Steel Materials.\nOur Standard\nOur company is certified to ISO 9001:2015 QMS Standard by SAC in October 2016 and also certified BizSafe Level 3 by the The Workplace Safety and Health Council of Singapore.', '0.00', '0.00', 0, 0, b'0'),
(46, 'Chong Fong Engineering Pte Ltd', '3 Tuas Ave 10, Singapore 639127', 'sales@chongfong.com', '199408798M', '-', 'About Chong Fong\nOur Founders Chong Fong was incorporated as partnership in 1976 by founders, Mr Khoo Chin Teng & Mr Ng Kok Sen, with S$18,000 capital. Through sheer determination & hard work, the company has grown into a multi million dollar enterprise, with footprints in Malaysia, Indonesia, China & Thailand.\n\nOur Philosophy\nOur growth has been build strongly based on our founders? winning philosophy reflected through the company?s name ???? , which means ?devotion? and ?success? in chinese. Devotion to our core values of honesty, trust, integrity, truthfulness & sincerity with our customers have been the key to our success.', '0.00', '0.00', 0, 0, b'0'),
(47, 'Yan San metal Pte Ltd', '17 Tuas Avenue 4, Singapore 639368', 'yansan@yansanmetals.com', '199200367G', '-', 'Incorporate in 1992, Yan San Metals Pte Ltd, is today, the market leader who can offer a range of Aluminium products and services that is unmatched in the industries.\n\nOur humble beginning as a leading stockist of aluminium alloy plates, extruded profiles and colour coated coils back by a wide array of inventories of various type of alloys, has growth and expanded into the manufacturing of Aluminium Honeycomb Core Composite Panel Systems. The honeycombs are available in a wide range of materials and cell configuration and are manufactured to customer specifications in tight tolerances.\n\nToday, we pride ourselves for being the only company in the Asia Pacific to have the cutting edge technology with State-Of-the Art manufacturing facilities of a complete aluminium honeycomb composite processing line and Friction Stir Welding capable of welding up to 5m x 12m plates.\n\nIn addition, we are the only company in Singapore to equip with a coil to coil, Colour Coating Line capable of coating a wide spectrum of Kynar 500 Fluorocarbon (PVDF) paint system finish.\n\nIn addition, our facilities are also well supported with the following machinery.\n\nCut-to-Length Line capable of shearing up to 4mm thickness by 1.525mm width.\nFluorocarbon (PVDF) spray painting and powder coating line\nFully automated anodizing line up to 1.8m x 6.5m\n4.3m length Press Brake and Shear Press\nHigh Definition Underwater Plasma Profile Cutter\nComputerized Turret Punch up to 2m x 6m\nRouter cutting service\nCoil to Coil Perforation\n\nOur products are the strength within some of today?s most advance technological applications in the marine, construction, transportation and aerospace industries.\n\nAs the most vertical integrated leader in this industry, we are able to control cost, quality and also the flexibility to support our customers worldwide.\n\nOur ability to provide industry leading service has been the main driver of our growth and the continual strong support from our valuable clients over the past years.\n\n\n\nQUALITY POLICY\nProvide Quality service and material to ensure customer satisfaction\nOperate reliable processes to fulfill approved specifications\nDevelop continuous improvement program to achive higher productivity', '0.00', '0.00', 0, 0, b'0'),
(48, 'Kim Ann Engineering Pte. Ltd', '3C Joo Koon Circle, Singapore 629035', 'info@kimann.com', '197400799C', '-', 'Kim Ann Engineering Pte Ltd is a \"one-stop supply service centre\" offering a comprehensive range of specialty metals and related value-adding services such as metal cutting, sizing, machining (blanking, milling, grinding), and heat treatment.\n\nWe operate from four plant facilities in Singapore, coupled with more than 10 overseas service centres in ASEAN, China, and India. Our customer base consists of industrial players from the Electronics, Precision Engineering, Oil & Gas, and Aerospace/Defense segments.\n\nKim Ann is proud to be the leading Oil & Gas and Aerospace metal stock centre in Singapore with a strong market presence in Asia Pacific. Our sales extends to more than twenty countries world-wide.\n\nWe Offer\nProducts / Metal sales \nHeat Treatment services \nValue-added Processing services \nSupply Chain Management (SCM) services', '0.00', '0.00', 0, 0, b'0'),
(49, 'Sin Cheong Engineering?(96) Pte Ltd', '132 Pandan Loop Singapore 128334', 'sincheon@singnet.com.sg', '199606981G', '-', 'Sin Cheong Engineering (96) Pte Ltd was established in the year 1979 providing services for all kinds of fabrication projects. To cater and reach out with broader spectrum of potential clients, our company was incorporated in 1996. Throughout the years, we were able to bring the most comprehensive range of services to our valuable customers. We now have decades of unparalleled experience in the field of fabrication and construction industry.Our company?s offerings involve all kinds of general, mechanical, steel structural fabrication, stainless steel and aluminium fabrication works. We also provide engineering services including CNC profile cutting, bending, rolling, mechanical overhauling, machining, and repairing works. Our vast range of service is offered to bring effective solution for the demands of various marine, manufacturing and construction industries.We are well-equipped with state-of-the-art machineries and tools for us to serve as customer?s one-stop center for all fabrication needs and requirements. Quality assurance, on-time delivery and competitive pricing will always be our edge to continuously and consistently be your number one reliable partner.', '0.00', '0.00', 0, 0, b'0'),
(50, 'Yi He Fa Enterprises Pte Ltd?', '60 Kaki Bukit Place, #01-01 Eunos Techpark, S', 'sales@yihefa.com.sg', '198203994D', '-', 'For more than 20 years, Yi He Fa Enterprises Pte Ltd has established a track record as the premier source of steel solution for industries in Singapore. Building on a solid foundation of Trust, Loyalty and Stability, Yi He Fa has also proven itself to be essential partner to the Marine & Offshore, Construction, Engineering and Oil & Gas industries of the region. \n\n\nNow a name synonymous to reliability and quality, Yi He Fa Enterprises sets the benchmark for their supply of high quality round/hollow bars and steel pipes.', '0.00', '0.00', 0, 0, b'0'),
(51, 'HUP FATT BROTHERS ENGINEERING (M) SDN. BHD.', 'No. 6 & 8, Jalan Maju 7 Taman Perindustrian C', 'sales@hupfatt.com.sg', '197901335W', '-', 'HFB was established in 1970 in Singapore and has expanded to other subsidiary like Hup Fatt Brothers Engineering Pte Ltd & HFB Technologies (M) Sdn Bhd in Johor Bahru, Malaysia. We are focused on bringing in and implementing up-to-date developments and technologies into HFB group and thus giving our customers a more fullfilled one stop services centre.', '0.00', '0.00', 0, 0, b'0'),
(52, 'Szu Engineering Pte Ltd', '16 Tuas South Street 3 Singapore 638054', 'sales@szu-engineering.com', '199701457D', '-', 'Szu Engineering is a provider of steel fabrication and design services, serving clients in a diversified range of industries such as F&B, specialty chemicals, process chemicals and offshore. Founded for more than three decades, the company has fostered strong business relations with many of the leading local and multi-national companies in Singapore.\n\nOur production encompasses 3 main activities, namely mild steel/structural steel fabrication, stainless steel fabrication and maintenance. The different competencies have broadened our scope of product and service provision, which include engineering design, fabrication & installation of structures, platforms, tanks & process pipes, as well as maintenance of plant facilities and equipment. With a team of strong and experienced workforce, we strive to inspire confidence and satisfaction in our clients with fine workmanship and high quality services.\n\nHaving vested interest in developing its human resource and operating capabilities to enhance productivity, the company invests substantially in production equipment, IT infrastructures and training programmes. We have successfully attained the ISO 9001:2008 quality management and OHSAS 18001:2007 safety management certifications.\n\nGoing forward, we will continue to leverage on our strengths to expand the scale of our business and establish a strong market presence, bringing the company to the next level of advancement and evolution.', '0.00', '0.00', 0, 0, b'0'),
(53, 'Topsteel Holdings Pte Ltd', 'Blk 5064 Ang Mo Kio Ind.Park 2, #01-1357 & 13', 'admin@top.com.sg', '200806822H', '-', 'At TOPSTEEL, we aspire the businesses of both our clients and ours to be at the TOP of the scale! Very frequently, sound kitchen equipment demonstrates the effective use of materials and creative design and construction techniques.\n\nNot only will our clients have a positive experience with their kitchen and overall business turnover, TOPSTEEL is valued for our kitchen design sensitivity and manufacturing.', '0.00', '0.00', 0, 0, b'0'),
(54, 'Asia Pacific Spiral Pte Ltd', '11 Tuas Avenue 6, Singapore 639299', 'enquiries@ap-spiral.com', '200602016K', '-', 'Asia Pacific Spiral \'APS\' was founded in Singapore (2006) and specializes in Spiral Welded Tubing; and Spiral Welded Perforated tubing \"Shroud\" Products. Supplying to the global markets, APS offers a versatile market specialist to all Global Oilfield Screen Manufacturers devoted to procure the optimum protection for their Sand Control Screen products.\n\nUtilising in-house engineering and ingenuity APS has designed and built their precision Spiral Mills with our existing and potential customers in mind. Our speciality mills provide all our customers with \'Flexibility\' in their design requirement/s, \'Speed\' in delivery, \'Efficiency\' thus offering competitive pricing; and most importantly \'High-Quality\' end-results.\n\n \n\nOverall, APS can provide turnkey design to fabrication complementing individual customizations and specialisations. Whether it\'s carbon, stainless or exotic alloy products you are looking for; APS accomplishes all manufacturing processes in-house so you can be assured that you are receiving unrivalled products that exceed expectations.\n\nTo further enhance our Quality Assurance, APS only procures raw materials from the world\'s best resources.', '0.00', '0.00', 0, 0, b'0'),
(55, 'Ann Aik (Pte) Ltd', '52 Tuas Avenue 9, Singapore 639193', 'sales@annaik.com', '200310976M', '-', 'Ann Aik Pte Ltd (Registration no: 197702066M) was incorporated in Singapore on 24 September 1977 and commenced operations as a stockist and distributor of general hardware products with a staff size of three in a rented shophouse.\n\nIn the early 1980s, Ann Aik Pte Ltd made a strategic move to specialize in the sale and distribution of stainless steel products due to less competition and higher profit margin. In 1989, the Company was appointed as an exclusive distributor of stainless steel butt-weld pipe fittings by a Japanese manufacturer. The Company also distributes and sells other stainless steel piping products, such as pipes, flanges, valves and fittings. Currently, the Company has approximately 10,000 different items stored in its Singapore warehouse to enables it to be one-stop supply centre for customers sourcing for stainless steel piping products.\n\nOn 4 September 2003, Ann Aik Pte Ltd was listed on the Singapore Stock Exchange and changed its name to AnnAik Limited. The successful listing of the Company?s shares marks a significant milestone in its corporate history.\n\nOver the years, the Company has been strengthening its business and in early 2000s, it expanded upstream into manufacturing of steel forged flanges in PRC. Todate, the Company has one plant in Malaysia which manufacture stainless steel and carbon steel forged flanges. The Company has also ventured into environmental business in 2005 by securing contracts to build wastewater treatment plants in PRC. Todate, the Company has 7 wastewater treatment plants in PRC under Build-Own-Transfer (?BOT?) or Build-Own-Operate (?BOO?) concept and 1 portable water supply company. In 2010, the company set up an environmental technology and engineering company in Singapore to undertake consulting services in water resource management for governmental and commercial operators. In 2015, the Company also venture into construct and supply of rural wastewater treatment equipment in PRC to further enhance its environmental and engineering division.\n\nOur Business\nOur company business can be segregated into three main divisions:-\n\nMANUFACTURING DIVISION ? Manufacture of steel forged flanges and high pressure steel forged fittings;\nDISTRIBUTION DIVISION ? Distribute stainless steel products which mainly used in piping system;\nENVIRONMENTAL AND ENGINEERING DIVISION ? Provide consulting services in water resource management, construct and operate industrial wastewater treatment plants and supply of rural wastewater treatment equipment.', '0.00', '0.00', 0, 0, b'0'),
(56, 'Applied Engineering Pte Ltd', '46 Tuas Road, Singapore 638499', 'enquiry@aepl.com.sg', '193400028W', '-', 'Applied Engineering Pte Ltd., an engineering and fabrication company, engages in the design and fabrication of process equipment, such as pressure vessels and heat exchangers for oil and gas, petrochemical and chemical, and energy related industries. Its products include vertical/horizontal pressure vessels, such as air receivers, clay treaters, decanters, degassers, desalters, driers, filters, vessels, hoppers, oil strippers, reactors, scrubbers, storage tanks, drums, separators, treaters, and more; and heat exchangers, which include shell and tube type, fixed U-tube, floating type, hair pin, double pipe, and air-cooled heat exchangers, as well as re-tubing of heat exchangers.', '0.00', '0.00', 0, 0, b'0'),
(57, 'BBN Industries (S) Pte Ltd', '48 Toh Guan Road East, #03-131, Enterprise Hu', 'bbnind@singnet.com.sg', '200300189D', '-', 'BBN INDUSTRIES (S) PTE LTD (Company No.: 200300189-D) Established in Singapore since 2003, specialized in Manufacturing of cable ladders & cable trays system. Head office located in Tuas-Singapore, With overseas factory in Malaysia BBN INDUSTRIES (M) SDN BHD & Batam PT BBN ENGINEERING.\n \nBBN has many years experience in design & fabrication of good quality cable ladder, cable tray and other fabrication works for the oil & gas, marine, construction and offshore industries. \n\nBBN has established a closed business relationship with both local and regional customers. \n\nOur ultimate objective is to provide our customer with sound peace of mind, in knowing that we will provide a high quality standard and having a stringent guideline with conformance to our customers\' specification or requirement by providing stringent quality check. Our mission is to exceed our customers\' expectations by supplying engineered products through our specialty while maximizing our quality, delivery and customer service. \n\nOver the years, BBN lndustries (S) Pte Ltd has established a wide pool of loyal customer by setting and maintaining a stringent quality finished products and services that exceed their expectations. To serve our customer better, we always take great pride and responsibility and remain proactive. BBN will rise to the challenges ahead by pursuing for continuous improvement in all areas.', '0.00', '0.00', 0, 0, b'0'),
(58, 'BDS Engineering Pte Ltd', '21 Senoko Way, Singapore 758043', 'support@bdsengine.com', '200308955H', '-', 'BDS Engineering Pte Ltd, we are a private company which provide support for Marine Digital Equipment, and it\'s accessories. We have collaboration with leading marine digital equipment providers. Our onsite team will provide end to end support to consumers and customers.\n\nWe do Design and Fabrication of Jigs and Fixtures, Cabinets, Enclosures, Other  sheet metal kinds of products. And we do have in-house facilities to do fabrication in order to meet various needs.', '0.00', '0.00', 0, 0, b'0'),
(59, 'Capital Engineers & Industries Pte Ltd', '12, Third Lok Yang Road, Singapore 628007', 'sales_enq@cei.sg', '198203071N', '-', 'A leading company offering customized manufacturing solutions to our customers.\n\nWe aspire to be a world class engineering company and recognized for our superior quality, services and technical expertise.\n\nTo achieve our vision, we have to be prompt and responsive to market conditions. Our customers expect quality products and services at a competitive price with on-time delivery.\n\nTo be our customers? preferred partner offering quality products and services at a competitive price with on-time delivery to achieve total customer satisfaction.\n \n\nQUALITY POLICY\n\nTotal Customer Satisfaction Through Quality Products\n\nQuality is everyone?s concern\nWe are doing things right first time, every time\nWe are building quality into products and processes during their development\nQuality means total compliance with the customer?s specifications\n\nQUALITY ASSURANCE\n\nWe firmly believe a robust quality system and good quality control improve our quality, reduce rejects and gives our customer confidence in our abilities. We utilize a variety of QC tools such as Statistical Process Control, Fish-Bone Chart, FMEA, etc to monitor our quality and come out with continuous improvement activities.\n\nTowards this end, we have strived to attain various QMS certifications through the years. We have been certified ISO9001: 2008 compliant since FY 2001 and we achieved ISO 14001: 2004 and OHSAS 18001 : 2007 certification in FY2012.', '0.00', '0.00', 0, 0, b'0'),
(60, 'Chee Cheng Engineering Pte Ltd', '74 Sungei Kadut Street 1 Sungei Kadut Industr', 'cceng5@hotmail.com', '199805066R', '-', 'We are an established manufacturer for Operable Walls product in Singapore. We are also the Steel Fabricator in all kinds of projects with experiences of more than 10 years. Our Job references are very substantial in the number of projects we have completed to-date including most Hotel, School, Community Clubs, Religious Building & Commercial Building.\n\nPRODUCTS\n\n1) Operable Walls\n2) Steel Fabrication Works\n3) Mechanical Engineering Works\n4) Industrial Piping Works\n\nPROJECT SERVICES\n\nWe have a Technical Team to Services & Repair all kinds of Operable Walls. At the moment we have regular clients like Hotels & Schools in serving of their Operable Walls. We are also the permanent Contractor for few factory in maintenance Works\n\nWe provide a WARRANTY to our product after final installation. Our professional team of technicians are readily available on after sales services.', '0.00', '0.00', 0, 0, b'0'),
(61, 'Chen Brothers Engineering Pte Ltd', '14 Tuas South Street 3, Singapore 638053', 'sales@chenbrothers.com.sg', '199503793Z', '-', 'CHEN BROTHERS ENGINEERING PTE LTD was established in 1995 by Mr. Tan Lee Seng. Prior to incorporation, Mr. Tan, who is presently the company\'s Managing Director, has a 25-year experience in the marine services & ship repair field. Through the years, the company has become a leading firm catering to repairs of ships & ocean-going vessels throughout the world.\n\nFrom its incorporation in 1995, Chen Brothers has grown from a small specialist marine engineering services company & diversified into a multi-faceted machining & fabrication yard.\n\nWe specialize in marine/ offshore engineering works & also offer a comprehensive range of services such as fabrication precision machining works & repair.\n\nOur main line of business includes:\nServicing of marine & industrial engines, pumps overhauling, repairs & installations\nBoiler repair & services\nAluminum & steel pipe fabrications, TIG.MIG, PTA welding\nElectric Panel Design & Fabricators\nIn 1997, in line with our expansion strategy, we moved to our new premise in Tuas occupying a new factory space of 27,000 sq ft.', '0.00', '0.00', 0, 0, b'0'),
(62, 'Choon Hin Stainless Steel Pte Ltd', '3 Joo Koon Crescent, Singapore 628009', 'info@choonhingroup.com', '199305976C', '-', 'Choon Hin Stainless Steel Pte Ltd has come a long way since our founding in the late 1950s. What began as a small business supplying and installing windows grilles has grown to become a group of companies providing total solutions to the construction industry in Singapore and around the region.\n\nEstablished in 1989, Choon Hin Stainless Steel is today, one of the leading company in the manufacturing and fabrication of stainless steel, brass, metal and glass products.\n\nBeyond just products, the company delivers value-added services that address the need of the ever-evolving construction industry. Our services include designing and building of columns and wall claddings, door frames and leaves, railings, shop fronts, canopies skylights and point fixing systems.\n\nHoused in our spanking new 50,000 sq ft facility in 3 Joo Koon Crescent are state-of-the-art equipment that makes and deliver quality products. Over the years, Choon Hin Group has built up a solid management and workforce that are highly experienced and skilled in the latest technologies.\n\nOUR VISION\nTo be the preferred source in the markets internationally by supplying products and services of superior value that exceed customers? expectations.\n\nTo be a value-added partner to our suppliers, contractors & customers.\n\nTo be the world leading manufacturer and fabricator of stainless steel, brass, metal and glass products.\n\nOUR MISSION\nTo Provide excellent products and services with prompt delivery and competitive prices.\n\nTo achieve customers satisfaction with zero defects attitude through teamwork, innovation, and continual improvements.\n\nTo maintain the highest levels of professionalism and integrity in our relationships with our suppliers, contractors and customers.', '0.00', '0.00', 0, 0, b'0'),
(63, 'Chung Ah Engineering Pte Ltd', '15 Sungei Kadut Avenue, Singapore 729651', 'sales@caengg.com', '198402575C', '-', 'Over the years, we have acquired in depth expertise and experience in a wide range of engineering activities.\nWe are committed to a system integrated approach serving our customers with high quality and on-time delivery.\n\nWe continue to serve a portfolio of clients which include not only local but also reputable international clientele.\n\nOur service and product lines include standard engineering services for Metal Fabrication, Rolling, Pressing and Shearing.\n\nWe also design and build enviromental products for waste disposal and erect flood prevention barriers. We are the distributor for the Asean region by Presray, America\'s leader of protective doors since 1955.', '0.00', '0.00', 0, 0, b'0'),
(64, 'FMB Trading And Engineering Pte Ltd', '15 Kranji Link, Singapore 728674', 'info@fmbtne.com.sg', '200922781N', '-', 'Laser cutting and sheet metal fabrication services are our core business. \n \nAt FMB Trading and Engineering Pte Ltd , customer satisfaction is our priority.\n\nFounded in 1991, the company was established to provide customized fabricating services to cater to our customers? requirements and needs. We specialize in complete sheet metal fabrication through using methods such as laser cutting, metal bending, metal rolling, metal shearing and complete sheet metal fabrication in mild steel, stainless steel and aluminium.\n\nWe believe in continuous investments in upgrading our equipment to improve efficiency on the fabrication and detailing of steel.\n\nWe can also provide the additional services at your convenience using our in house capabilities:\n- Engineering consultancy\n- Surface Treatment such as powder coating, painting and sandblasting. \n- Sheet metal related contract manufacturing services (High mix ? low volume)\n- Rapid prototyping\n- Retailing of raw materials from plates to hollow sections\n- Integration/Assembly works (One Stop Service Center)\n- Reverse Engineering', '0.00', '0.00', 0, 0, b'0'),
(65, 'Soon Huat Hin Hardware Enterprise Pte Ltd.', '18 Tuas Ave 18A, Singapore 638868', 'main@shhhardware.com', '201216674G', '-', 'Established since 1981, Soon Huat Hin Hardware Enterprise Pte Ltd is a Singapore based company specializing in Metal Cutting Services serving the diverse industrial needs ranging from Marine, oil & gas, heavy machine manufacturing, construction to many other related industries.\n\nFor more than 3 decade we specialize in metal cutting services of Steel Plates. We use Plasma CNC Cutting Machine to cut plates into various of sizes & shapes.\n\nSoon Huat Hin has built a reputation to handle complex requirements using automated AutoCAD?s system drawings and we are capable in handling up to 8ft x 30ft metal cutting.\n\n\nBeing one of the market leader in Metal cutting. We actively strive for improvements by continuously engaging our valuable client?s feedback.\n\nTo cater with the different demands from the growing industries, we have added more machines to fulfill the growing demands.\n\nDedicated to building long-lasting and trusted relationships through efficient customer service, cost saving for our clients and on-time delivery.\n\nMaterials: Mild Steel Plate / EH36 Steel Plate / Stainless Steel Plate ', '0.00', '0.00', 0, 0, b'0'),
(66, 'Chuan Leong Metalimpex Co. Pte Ltd', '51, Tuas Bay Drive, Singapore 637306', 'mailbox@clmetal.com', '197300123R', '-', 'At Chuan Leong we employ the latest automated equipment to ensure the very best service standards. Our materials are all produced from reputable steel mills that meet international standard and our role is to store the material in good condition before delivery.\n\nChuan Leong have gained a well earned reputation with steel users and shipyards in the region for maintaining the highest service standard as well as quality where possible.\n\nActing as a steel supplier and stockist company in our purpose built premises, our steel are recognised for quality and excellence. If you are looking for a steel stockist of mild steel plates/profiles, shipbuilding steel, boiler plates, or API Pipes, look no further than the market leaders Chuan Leong Metalimpex Co., Pte Ltd.', '0.00', '0.00', 0, 0, b'0'),
(67, 'Sea United Shipbuilding & Engineering Pte Ltd', '30 Kian Teck Drive, Singapore 628847', 'enquiry@seaunited.com.sg', '199100053D', '-', 'SEA UNITED SHIPBUILDING & ENGINEERING PTE LTD, incorporated in 1991, started its principal activities as a sub-contractor of major tankers, shipbuilding and other ocean-going vessels. We carry out steel fabrication and repair works with a start up capital of S$300,000.00. \n\nIn the year of 1993, due to the demand of our services, the management has decided there is a need to cater and facilitate direct controls over product quality and improve efficiency. We started to operate our own purpose built factory in year 1994, an extensive contractor to provide better and wide range of fabrication, repairing and other steel structural work for marine, shipyard/shipbuilding Oil and Gas companies. \n\nOver the years, we have an average workforce of 40 proficiency experience engineering and quality control employees, to enhance our quality service and high standard of performance. With our commitment and on-time delivery, we adhere strictly our principle to gain the trust and continual supports from many prominent local and international clients. \n\nOn 29th January 2003, our company has achieved the prestigious ISO 9001-2000 quality management system certification.\n\nCommitment \nWe continually to strive and provide our best quality services to assure in achieving total customer satisfaction.\nWe take pride to ensure our services to the clients are profession, reliability and efficiency. We tailor the solutions to meet our clients? requirements and continual improving our productivity as to establish a preferred international vendor.', '0.00', '0.00', 0, 0, b'0'),
(68, 'Yeow Hwa Engineering Pte Ltd', '7 Tuas Ave 11 Singapore 639073', 'yeowhwa@yhepl.com', '198304889K', '-', 'Yeow Hwa Engineering Pte Ltd or YHE was established in 1969, engaging initially initially in Iron Works and General Engineering works. Through the years, we have expanded into offshore oil and gas, power plant heavy industries mechanical engineering and even ship repair support business.', '0.00', '0.00', 0, 0, b'0'),
(69, 'Aik Lian Metal & Glazing Pte Ltd', '15 Yishun Industrial St. 1, #08-27 Win5 @ Yis', 'aiklianmetal@singnet.com.sg', '201117953G', '-', 'Aik Lian Metal & Glazing started its humble beginning providing miscellaneous metal works with highest level of quality and assurance of 100% on-time deliveries.\n\nThrough the years, we has been recognized as a reputable contractor specializing in design, fabrication, supply and installation of structural & architectural metal works including architectural aluminium products for high and low-rise buildings, residential houses, retail outlets, shopping malls, offices, MRT projects and HDB project.\n\nWith our recent expansion of factory and integration of new machineries, we?re able to accommodate our client?s expectation with high quality and precision.\n\nWe offer complete construction services including design assist services, in-house fabrication and field erection. This, together with our technical management and high quality fabrication, allow us to offer proficient and consistent solutions for each of our customer. The projects implemented by our team always generate great satisfaction and appreciation from customers.\n\nOur mission is to become the best provider within our industry in providing on time the highest quality products & services. Our commitment in providing the most innovative approach and value engineering is one that guided our company to the excellent level.\n\nOur Services\nStrength and safety are qualities that are naturally associated with metal; the same can be said of Aik Lian Metal & Glazing Pte Ltd\n\nWith a recent expansion of our factory and over 50 workforce, our complete in-house capabilities successfully enables maximum flexibility, fast response and absolute coordination of all phases of any projects.\n\nWe specialized in:\n\nDesign, Fabrication, Supply and Installation of Structural Steel Works.\nDesign, Fabrication, and Supply of Special Steel Assemblies including brackets.\nDesign, fabrication, supply and installation of architectural metal works (Galvanised Steel, Stainless Steel, Aluminium and Glazing Products such as:\nBarricade and Handrails (Galvanised Mild Steel or Stainless Steel)\nStainless Steel Ceiling for Hoods\nSteel grating / sump grates (Galvanised or Stainless Steel)\nWalkways / Catwalk (Galvanised Mild Steel)\nSteel fencing (Galvanised Steel or BRC Fencing)\nCat ladder (Galvanised Steel, Stainless Steel or Aluminium)\nMetal sunshades/ awning\nWorking Platform\nTruss girder for infrastructure work\nConcrete Moulds\nPlatform/ pipe rack/ cat walkway\nLintel Frames\nSteel building entrance and fa?ade\nBracket supports\nSteel staircase/ stairway\nLinkway\nGreenwall\nMetal roofing\nCladding frame\nMetal decking\nLetter Box\nBike Racks\nCurtain Wall System\nCladding Panelling Works\nWindows & Doors\nSkylights & Canopies\nSunshades / Trellises', '0.00', '0.00', 0, 0, b'0'),
(70, 'Joo Heng Engineering Pte Ltd', '1000 Tai Seng Avenue 1 #01-2502 Singapore 534', 'jhengrg@gmail.com', '201322172H', '-', '', '0.00', '0.00', 0, 0, b'0'),
(71, 'Lian Siong Aluminium & Trading', '\n1 , YS-ONE, #01-23, YISHUN STREET 23, SINGAP', 'liansiong@singnet.com.sg', '200609268Z', '-', '', '0.00', '0.00', 0, 0, b'0'),
(72, 'Leong Siew Weng Engineering Private Limited', '9 Tuas South Street 15 Singapore 637077', 'enquire@lswe.com.sg', '198902769Z', '-', 'Leong Siew Kwan and Leong Tuck Weng, a Father and Son Tag Team that wrestled the challenges of a contractor providing services to the civil and construction Industry in the late Eighties and built up a strong foundation for Leong Siew Weng Engineering Private Limited (LSWE). Since 1989, the names of these two men has been synonymous with ?Getting the Job Done? for their customers and earned LSWE the reputation of being Your Reliable Partner in providing quality engineering solutions in the form of steel works to varied industries ? civil building, marine & offshore, etc.\n\nFrom small staff strength in a modest workshop at Ang Mo Kio Industrial Park, LSWE has grown to a total workforce of over 200 today at Tuas. In the year 2005, LSWE first forays into the Offshore & Marine sector began with a project awarded by an offshore equipment company for fabrication of skids for mounting cement mixing system on oilrigs, then followed on with another project for building diving system. Since then, LSWE has completed various types of steelwork fabrication and engineering projects to the offshore and marine industries for Diving system, Pressure Vessels, Production and Modular structures.\n\nAlso a workshop with turning, milling & drilling facilities was set up at Tuas South to manage all machining processes and sub-contracted services like coating, PWHT and precision machining. At the same period, LSWE started the SWORD & SHIELD initiatives below:-\n\nS.W.O.R.D. ? Steel Works for Offshore & maRine Division\nTo manage steelworks & fabrication process for O&M sector.\n\nS.H.I.E.L.D. ? Special projects, mecHanical & In-situ Engineering, Laser Division\nTo manage machining works, on-site works and related process for O&M sector.\nTo provide in-situ machining, metal stitching and alignment services for marine diesel engines, offshore components and structures.\n\nBoth initiatives comprise teams of highly experienced and competent team of professionals capable of handling engineering projects with flexibility and the ability to produce timely deliveries by allocating experience resources to manage customers\' projects was required. In every project we aim to exceed our client?s expectations in every aspect of quality, response time, pricing and delivery. Our dedication to the above has made us one of the most cost-effective and highly respected engineering solution providers locally and regionally. Through the efforts of our talented workforce and excellent infrastructure, we have built a lasting and highly competitive advantage.', '0.00', '0.00', 0, 0, b'0'),
(73, 'Metalix Pte Ltd', '4 Penjuru Place, #01-14, 2.8 Penjuru Tech Hub', 'pauleesti@gmail.com', '201401802M', '-', 'We have the ability to think up cutting-edge solutions to build a legacy of quality, innovation and technology in the construction industry.\n\nMetalix Pte Ltd is a young, vibrant engineering company incorporated in Singapore. As to date, we are proud to say that we hvae vast experience after involving in more than 200 projects. Over the years, we have ventured into research and development of our own OEM products with the vision of offering quality and value added products to the local and overseas markets.', '0.00', '0.00', 0, 0, b'0'),
(74, 'Triton Metal Supplies Pte Ltd', 'Blk 48 Toh Guan Road East #05-102 Enterprise ', 'enquiry@tritonmet.com', '200904916E', '-', 'Triton Metal Supplies Pte Ltd is an established fabricator/manufacturer of architectural aluminum building products and systems for the commercial construction industry. Providing single-source responsibility, our comprehensive product portfolio includes entrances, framing systems, curtain walls and windows.\n\nOur products are suitable for high- mid- and low-rise buildings such as schools and universities, healthcare facilities, government buildings, stadiums and sports facilities, office buildings, multi-family housing, and retail construction.\n\nWe are committed to responding to the industry\'s needs in every way possible - through rigorous testing, meticulous engineering and product design, a focus on sustainability and dedicated partnership. As we renew and re-engineer our capabilities, our commitment to quality, reliability, and cost efficiency has remained constant since the day of incorporation.', '0.00', '0.00', 0, 0, b'0');
