(75, 'Yew Huat & Co. Pte Ltd', '10 Loyang Walk, Singapore 508793', 'derick@yewhuat.com', '199701743K', '-', 'Yew Huat & Co. Pte Ltd is a sheet metal fabricating and engineering Firm. It works with Steel, Aluminum and Stainless Steel and has recently included Wood as a raw material for designing and Interior fitting requirements. It believes that good design, attention to detail and precision workmanship make each and every piece a work of Art. With its metal expertise and experience, Yew Huat aims to provide greater value-add services to customers.', '0.00', '0.00', 0, 0, b'0'),
(76, 'Prefab Technology 3 Pte Ltd', '99 Pioneer Road Singapore 639580', 'hq@prefabtech3.com.sg', '199300335K', '-', 'Prefab Technology Group (part of Hor Kew Co. Ltd) consists of Prefab Technology Pte Ltd, Prefab Technology Sdn Bhf, Prefab Technology 3 Pte Ltd, Prefab Metal Sdn Bhd, Prefab Technology 8 Pte Ltd, each specialised in different area of work.\n\nThe Group design & manufacture many products, namely:\n\n Precast concrete building components\n Prefabricated architectural metal components\n Lock Tap\n Re-bar connector\n Building System : Prefabricated, Pre-finished, Volumetric Construction (PPVC)', '0.00', '0.00', 0, 0, b'0'),
(77, 'Global Steel Pte Ltd', '16 Jalan Kilang Timor #04-08 Redhill Forum, S', 'jm@globalsteel.com.sg', '200600907G', '-', 'Global Steel is an international procurement house with its regional headquarters well situated in Singapore.\n\nSince its inception Global Steel has been positioned to take advantage of our worldwide network of reputable manufacturers and stockists, enabling us to serve the following target industries in a professional and cost effective manner.\n\nOur range of products are extensive although our primary focus is on Pipes, Fittings, Flanges, Special Forgings, Special Piping Components and Clamp Connectors.\n\nStrategically located in Singapore, Global Steel is a fast growing international procurement house. By virtue of our location, Global Steel is in close proximity to major players in the heavy and energy industries.\n\nOur strength lies in our established worldwide network of reputable manufacturers and stockist; bringing about timely delivery, cost savings and providing a total solution for your project procurement needs.\n\nGlobal Steel success is attributed to its inherent qualities of tenacity, resourcefulness and professional customer oriented business approach.', '0.00', '0.00', 0, 0, b'0'),
(78, 'Yaw Ngiap Pte Ltd', '16E Enterprise Road, Enterprise 10, Singapore', 'sales@yawngiap.com', '201538422M', '-', 'Established in 1977, Yaw Ngiap has been a provider of premium quality manufacturing services to a wide array of industries for decades. As an ISO 9001 certified company, we committed to providing high quality services, best industrial practices and practical solutions that are consistent with the goals of our clients. Our clients? satisfaction with us has always been a testimonial to the high quality of our products. We understand that successful relationships translate into successful projects, hence we value our clients as partners where mutual respect, trust and integrity lead to long term relationships.\n\nAt Yaw Ngiap, we aim to be a one-stop solution provider for our valuable clients to help them improve time management and reduce manufacturing costs. The team at Yaw Ngiap comprises of skilled, experienced professionals that are competently trained, with a strong belief in the philosophy of being dedicated to provide the highest quality of service to our clients. Yaw Ngiap achieves an excellent retention rate for both clients and employees because we focus on client service, employee development and recognition of effort.\n\nOUR SERVICES\nIn Yaw Ngiap, we understand that service, quality, time and price are important to our clients. That is why we provide services from the initial prototyping to assembly and testing, where our stringent QC ensure that the quality of our product adheres to your requirements, all under one roof. By doing so, we not only help to save time, we also help to reduce the manufacturing cost incurred, thereby improving your bottom line.\n\nFABRICATION\nFabrication is the art of building components by utilizing processes such as cutting, bending, welding and many more. It is a value added process that results in the construction of machines and structures from various raw materials. Fabricating is the foundation of our company; hence we take steps to make sure that the products we fabricate are of the best quality using the modern machines we possess in our factory. With decades of experience under its belt, Yaw Ngiap specializes in fabricating materials such as steel and stainless steel to create high quality products that go beyond our customers? expectations.\n\nPRECISION MACHINING\nPrecision Machining is an extremely important area in the manufacturing industry, and it could be said as the backbone of manufacturing in Singapore, as the manufacturing industry accounts for 20-25% of Singapore?s GDP. It is also one of the key areas of expertise for Yaw Ngiap. With years of experience in this area, Yaw Ngiap is a company you can trust for its quality and capability. With a plethora of advanced machinery such as the HAAS ST40L and state-of-the-art technology, we are able to fully replicate what our clients want and produce something that exceeds our clients? expectations. This is what makes Yaw Ngiap a bar above the rest.\n\nASSEMBLY AND TESTING\nAs the ever-changing world has now become more focused on the quality of products produced, testing and having quality checks are of paramount importance to ensure that our customers are satisfied with the outcome. In the past decade, we have assembled machines for projects locally and overseas, where we have tested and ensured the machines are in excellent condition before they are shipped. With our high standards for quality and meticulous QC checks, every product that leaves our assembly and testing line is a product that is ready to be used for the world.', '0.00', '0.00', 0, 0, b'0'),
(79, '3D Metalforge Pte Ltd', '10 Science Park Road, #02-02, The Alpha, Sing', 'info@3dmetalforge.com', '201626546H', '-', 'We are a leading global AM company that supports cutting-edge companies with their global metal printing requirements. Our hi-tech facility and engineering teams are based in the global city of Singapore with technical support offices being opened in US and UK. We have one of the most advanced range of printing equipment including our new one of a kind LAAM printer that can produce high quality metal parts up to 1.5metres in size, and at a speed of up to 1kg per hour.\n\nOur Mission\nTo provide industry-standard, cost-effective metal additive manufacturing solutions that forge new possibilities for manufacturers and brand owners.\n\nOur Work\nWe work closely with both MNCs and SMEs to customize solutions that are immediately applicable, with the aim of generating long term benefits such as improved design and operational cost-savings.\n\nOur Clients\nWe work with companies in the marine, offshore, oil & gas, precision engineering, manufacturing and heavy industries across Southeast Asia.', '0.00', '0.00', 0, 0, b'0'),
(80, '3D Matters Pte Ltd', '10 Science Park Road, The Alpha, #02-02, Sing', 'info@3dmatters.com.sg', '201208081N', '-', 'Headquartered in Singapore, 3D Matters is one of the longest established Additive Manufacturers in Southeast Asia with a strong track record of helping clients grow their 3D printing needs.\n3D Matters was started by Mark Lim and Hayden Tay in 2012 and is now in its next wave of growth ? developing as an end-to-end, integrated 3D Printing Service Bureau to support our clients through all stages of their 3D printing journey from diagnostic and consulting, to design capture and material selection, right through to printing and finishing.\n\nOur team is one of the strongest in the sector with the senior management team of CEO Matthew Waterhouse, Technical Director Mark Lim and Design Director Hayden Tay, and function heads in sales, marketing and engineering.\n\nWith an uncompromising commitment to establishing high quality standards for both customers and within our organization, 3D Matters is the first specialized 3D printing company in Singapore to have attained the ISO9001:2015 certification.', '0.00', '0.00', 0, 0, b'0'),
(81, 'Creatz3D Pte Ltd', '180 Paya Lebar Road, #08-07 Yi Guang Factory ', 'info@creatz3d.com', '201219797H', '-', 'About Creatz3D\nWith over 15 years of experience in providing 3D printing solutions in Singapore, Creatz3D has worked with more than 150 professional installed bases from commercial companies to research facilities and many more.\n\n3D printing can be used as a complete solution from idea design to end product. As compared to traditional manufacturing, 3D printing makes it possible to take risks, develop customized solutions, and to reduce time and cost.\n\nAll of these make 3D printing technology a compelling investment for many industries.\n\nWhat We Deliver\nCreatz3D is the authorised reseller of professional industrial-grade 3D printers, which include Stratasys? 3D printing systems and materials for plastics, Arcam? additive manufacturing systems, Desktop Metal Studio System, SISMA additive metal manufacturing systems and XJET Nanoparticle Jetting technologies for top-grade metal components, as well as our newly acquired patent for 3DCeram? solutions for ceramic 3D printing.\n\nBesides providing comprehensive solutions, we have also partnered with Materialise? for their Rapid Prototyping Software Solutions: 3-matic, Magics RP and Mimics Innovation Suite, which can aid your design and production workflow.\n\nShaping the World with Industry Applications\nMindsets are rapidly shifting that 3D printing isn?t just a niche technology, but rather something that can be leveraged upon long-term wise, that can impact how products are produced and disrupt supply chains.\n\nToday, there is a growing demand to deliver in terms of efficiency and time, and this is where 3D printing comes into play. With the assured quality of parts delivered at low costs, the adoption pace of 3D printing technology to complement existing production methods continues to grow rapidly. With businesses looking to stay ahead of their competition, it is imperative for them to turn to 3D printing to enhance their workflow.\n\nToday, our extensive clientele portfolio reflects a wide variety of industries ranging from research, automotive to consumer goods productions ? demonstrating the expanding potential for applications in 3D printing.\n\nAssisting you in every step of the way\nTo make the most out of our industry-leading 3D technologies, our experienced team of experts are always ready in offering our knowledge and expertise to our clients.\n\nWith years of accumulated experience, our application engineers can ably assist on the possibilities of integrating 3D printing into your manufacturing process from idea design to end product. Stellar post-sales support in the form of installation, off/on-site servicing, or training programmes are handled by our dedicated team of customer support engineers who are certified by the 3D printer makers and have met stringent qualifications.', '0.00', '0.00', 0, 0, b'0'),
(82, 'ST DYNAMICS PTE LTD', '249 Jalan Boon Lay, Singapore 619523', 'contact.dynamics@stengg.com', '53109449M', '-', 'ST Dynamics is the Advanced Engineering Center of ST Engineering. We are a system house which develops advanced engineering systems to help customers address their complex technical challenges in areas related to unmanned system, machine vision, sensor network and software algorithms.\n\nOur role is to be a market-focused developer of new products and services based on emerging technologies and business concepts. We believe in working closely with inventors, innovative firms and the academia, to develop strategic partnerships that can offer innovative engineering solutions to the market.\n\nST Dynamics offers a product development framework that will help innovative firms bring their solutions to the marketplace in the most expeditious manner. We can assist in the aspects of business planning and product development and commercialization.\n\nOUR APPROACH\nWe bring to our customer new or enhanced capability through our technology and innovation.\nWe work with our customer on concept development and system prototyping.\nWe focus on specific technology development while teaming up with global technological partners to offer a smarter solution.', '0.00', '0.00', 0, 0, b'0'),
(83, 'Tronrud Engineering', '81 Ubi Avenue 4, #03-27, Singapore 408830', 'support@tronrud.sg', '200817974D', '-', 'Tronrud Engineering has been practicing our vision of ?Putting Ideas Into Practice? since 1977 and has since then completed thousands of projects for satisfied customers in a wide variety of industries. Our skilled employees will develop, construct and deliver innovative and high quality products and services and follow up every project from its beginning to conclusion.\n\nThe main office and manufacturing site is located one hour drive from Norway?s capitol Oslo, and in addition we have a smaller services and projects office in Singapore.\n\nOur services include automation drawings, mechanical design and development, titanium components machining, and much more. Our 15 current generation CNC machines, a water jet cutter, an EOS laser sintering 3D printer that can even do titanium, as well as state of the art welding, assembly halls and equipment ? ensures efficient and cost effective production.\n\nAutomation Consultancy\nTronrud Engineering has delivered industrial automation projects to enable new technologies or improve HSE and production in customers facilities for 35 years and has picked up many lessons learned and best practices during these years. We can assist in factory design, mechanical design and factory automation consultancy for most industries including PLC (programmable logic controller) improvements, and propose ways to increase productivity.\n\nOil & Gas / Offshore\nTronrud Engineering has a long tradition in offshore / oil & gas machining services and producing automation for offshore / oil & gas, improving HSE and productivity for our customers. We have delivered anything from extremely low tolerance titanium seals to seismic activities production lines and pneumatically driven transport trolleys for moving heavy objects like turbines onboard vessels.\n\nPV & Renewable Energy\nTogether with a Norwegian benchmark company in the PV solar industry, Tronrud Engineering has developed a range of PV automation for solar wafer fabrication and solar cell manufacturing as well as load / stress testing for PV modules. We continue to offer automation for this industry to the customers that wants the lowest yield loss and highest availability of their automation.\n\nMachining\nOur well-equipped machining workshop can machine any metal including titanium to very high customer specifications. We also have a metal printing 3D printer that can handle titanium as well as other metals.\n\nTextile / Weaving\nOne of our products is a high speed, easy to work with, next generation loom called the TC2. It is suitable for high speed and ultra-flexible weaving where patterns can be uploaded from your PC design program in a minute. We call this digital weaving as it is an automated weave.\n\nAerospace\nBased on our described competency we also deliver special automation and machining services to the Aerospace industry.\n\nWe are looking forward to your request!', '0.00', '0.00', 0, 0, b'0'),
(84, '3d Printing Studios Asia Pte Ltd', '114 Lavender Street #01-50 CT Hub 2, Singapor', 'Singapore@3DPrintingStudios.com', '201416399K', '-', 'Bringing Ideas to Life\nOur motivation is to help our customers ?Bring Their Ideas to Life? by leveraging various 3D technologies in their business and making it a part of their competitive edge in any industry.\n\nWhether you are a complete newcomer to 3D technologies or an expert CAD modeller, we can help.  The experienced team at 3D Printing Studios consist of qualified and highly skilled 3D Industrial Designers, Product Designers, and Engineers. 3D Printing Studios has delivered many successful projects of all sizes and complexities using the latest 3D technologies.\n\nOur Mission\nTo be the #1 one stop 3D Printing technology company across Asia Pacific region.\n\nCompany Milestones\n2013\n? Established Australia?s 1st 3D Printing retail shop in CBD (George Street), Sydney and was the 5th Worldwide (After New York, London, Amsterdam, Japan).\n\n2014\n? 3D Printing Studios Perth was open and Sydney opened their second studio in Parramatta.\n? 3D Printing Studios Singapore was established as a local company and Asia Hub.\n\n2015\n? What a year of exponential DD growth!\n? First BIG 3D Printing Hub in the Sydney CBD after consolidation opened\n? We trained our 2,000th person in 3D Printing.\n\n2016\n? We grew faster than expectation in Singapore with DD growth.\n? 3D Printing Studios Singapore moved in to a bigger industrial facility to accommodate more industrial 3D printing capabilities.\n\n2017\n? Expanded into Melbourne\n? Purchase of a Fortus 900, one of the largest FDM printers in Australia and only one of six in the country!\n\n2018\n? Expanded into Malaysia', '0.00', '0.00', 0, 0, b'0'),
(85, 'Eye-2-Eye Communications Pte Ltd', '701 Sims Drive #02-01 LHK Building, Singapore', 'sales@eye2eye.com.sg', '199508096M', '-', 'Eye-2-Eye Communications Pte Ltd was incorporated in the late  1990s in Singapore by Miles Podmore and John Lyons  with the mission of making Eye-2-Eye a regional market leader for optical technology products and solutions. Over the years, Eye-2-Eye has expanded with offices in Malaysia, Philippines, Indonesia and Vietnam and has partners in most other countries in SE Asia.\n\nEye-2-Eye is the largest regional provider of optical CD/DVD/Blu-ray solutions. In combination with this technology focus we have added a range of solutions to help industries Distribute Information, Store & Archive Information and in the specific industries of Medical & Dental we are helping them to Go Digital with a range of different solutions.\n\nSupport and Maintenance is one of our key strengths and is an area that we are expanding as we continue to grow.  One of our key advantages is that we have been supplying the major industries and companies in mission critical applications since 1996 and thus have a unique knowledge and understanding of how important it is that the equipment that we supply is running at all times.\n\nOur customers are in industries such as broadcast & media, education, finance, government, medical, dental, manufacturing & high-tech, science & engineering.\n\nWe are committed to providing innovative solutions that help our customers grow this business and be more competitive.', '0.00', '0.00', 0, 0, b'0'),
(86, 'UCT Additive Manufacturing Centre Pte Ltd', '2 Woodlands Sector 1, #05-22, Woodlands Spect', '3dprinting@uct.com', '201107867K', '-', 'UCT has a 20-year experience as a global contract manufacturer. We have been the leader in engineering and manufacture of critical subsystems and turnkey solutions for numerous industries. We are bringing our extensive knowledge in manufacturing of advanced products and state of the art of the art factory management, into the world of 3D printing.\n\nWe are both a supplier and a consumer of 3D parts. We provide expert rapid prototyping and specialty manufacturing solutions to our customers. At the same time, we use 3D printing in our production processes to accelerate manufacturing of key components and enable virtual warehousing.\n\nWe understand the value in producing complex geometries that are difficult to manufacture using traditional manufacturing methods and the flexibility of customization for specialty manufacturing requirements.\n\nWe have a deep appreciation of how 3D printing supports traditional manufacturing by offering great flexibility in customizing complex items form speciality manufacturing requirements.\n\nWe also know that 3D printing is not a complete replacement for traditional manufacturing but rather complements your manufacturing process by efficiently reduce manufacturing time with improved design parts.\n\nOur Commitment\nOur experienced and dedicated team are trained to listen to your requirements, as a customer, and educate you with the best solutions to your needs.\n\nOur culture is built around exceeding customer requirements and we have done so with over 10,000 printed parts to date. With our sound quality culture, we aim to produce quality parts while meeting your cost requirements and delivering your parts on time.\n\nCompany\nUCT Additive Manufacturing Center Singapore is a subsidiary of Ultra Clean Holdings, Inc. (NASDAQ: UCTT). Read more about UCT\n\nThe UCT Additive Manufacturing Center was officially opened on 28 September 2015 and has since led the commercial 3D printed scene in Singapore, printing thousand of parts to hundreds of satisfied customer worldwide.', '0.00', '0.00', 0, 0, b'0'),
(87, 'Spare Parts 3D Pte Ltd', '91C Lavender Street, 338719 Singapore', 'contact@sp3d.co', '201527331E', '-', 'Spare Parts 3D supports the digitalization of your inventory and enable on-demand production and rapid delivery of your spare parts using 3D printing.\n\nAbout Us\n\nThe era of cars painted in any colour as long as it is black is over. Customers demand more tailor-made objects, from shade to measurements. We are going from customization, when the manufacturer offers different options to his customer, to customerization, when both customer and manufacturer are involved in the product creation.\n\nTherefore, manufacturers need to interact with their customers on a regional scale in order to adapt locally and rapidly, which is made possible by a distributed infrastructure equipped with not only communication means, but also manufacturing means. Similar to how the internet has enabled the distributed communication, we strongly believe at Spare Parts 3D, that 3D printing will enable distributed production.\n\nBefore implementing such model, manufacturers need to overcome critical issues brought by distributed manufacturing: quality, costs, and intellectual property management.\n\nThis is what Spare Parts 3D aims at providing you with, so that together, we build up a new manufacturing system delivering tomorrow?s services!', '0.00', '0.00', 0, 0, b'0'),
(88, 'Siege Advanced Manufacturing Private Limited', '38 Ang Mo Kio Industrial Park 2 #04-22, 56951', 'daphne@siegeadvancedmanufacturing.com', '201703018W', '-', '3D printing has always been the core of our company?s business in Singapore. Armed with not just a fleet of highly advanced and reliable 3D printers, but also powerful 3D printing management software, our company, boasts production abilities that matches that of injection molding factory lines in Singapore.\n\nWhy Work with Us\n\nPrice\nOur price has always been optimized just for you to bring up an economically viable option for low to mid quantity mass manufacturing using 3D printing. So what does this means? It means that we will try our best to match our prices with that of injection molding. You can be sure that we are one of the most price efficient 3D printing service bureau in Singapore when it comes to mass manufacturing.\n\nQuality\nWe know that you value your product and therefore we only use the highly acclaimed Original Prusa i3 MK2S 3D printer for manufacturing. The Original Prusa i3 MK2S 3D printer is the highest rated 3D printed on 3D Hubs and it was also voted the Best Printer by MAKE magazine. Coupled with a stringent inspection process, we make sure that only the the product that meets the mark will be able to roll of our factory floor.\n\nSpeed\nEquipped with a fleet size of 18 of the Original Prusa i3 MK2S 3D printer, we are able to ensure a fast turnaround time for your business. Many of our clients also opt for the start up program where we manufacture parts on demand. The large fleet size of 3D printers and speed of the Original Prusa i3 MK2S allows us to keep our turnaround time as short as 6 hours. This will ensure that you?ll be able to keep your delivery deadlines and also your cost low.\n\nQuantity\nManaging a fleet of 18 3D printers can be quite a tough nut to crack but thankfully we have an advanced system of both hardware and software to efficiently command and control all our 3D printers in parallel manufacturing.\n\nWe promise you high quality results within a short time frame. ', '0.00', '0.00', 0, 0, b'0'),
(89, 'Asia Galvanizing (S) Pte Ltd', '22 Benoi Road, Singapore 629892', 'asiagalv@asiagalv.com', '201002226R', '-', 'The AGV Group and its subsidiaries are leading providers of hot dip galvanizing services in Singapore. Helmed by its two founders, Albert Ang and James Ang, who have over 30 years of industry experience collectively, the group has been profitable since starting operations in 2012.\n\nAt the centre of the Group?s operations is its fully-equipped S$16 million plant that sits on approximately 11,000 square metres of land. It is strategically located in the heart of Singapore?s heavy industries in Tuas, where it is within relatively close proximity to most of its customers or companies in the steel or iron fabrication markets. The plant operates round-the-clock throughout the year with the capacity to handle up to 5,000 tonne of hot dip galvanizing each month.\n\nBeyond the hardware, the Group comprises a team of highly experienced staff and skilled workers who ensure quick turnaround time of orders and high quality services and output. This is one of the core reasons why the Group has been able to rapidly increase its market share while enjoying recurring business from over 50% of its customers since inception.\n\nToday, the AGV Group serves over 900 clients from diverse sectors including the public sector and transport sectors.', '0.00', '0.00', 0, 0, b'0'),
(90, 'Unik Engineering Pte Ltd', '52 Tuas Basin Link Singapore 638781', 'enquiries@unik.com.sg.', '198601761E', '-', 'Since its incorporation on 23 August 1986, UNiK Engineering (Pte) Ltd has been a leader in hot dip galvanizing technology in Singapore.\n\nThe company has built a solid reputation for its superior engineering works and services in the construction, marine and petrochemical industries over close to 30 years in the highly specialized field of galvanizing.\n\nBoasting cutting edge galvanizing technology and two best-of-class galvanizing kettles, measuring 12.5M (Length) x 1.5M (Width) x 2.5M (Depth) and 7.3M (Length) x 1.5M (Width) x 3.0M (Depth), it is able to handle a wide range of engineering projects, covering standard and customized galvanized structures.\n\nUNiK Engineering is accredited the ISO-9001, ISO-14001, OHSAS-18001, BizSafe Star certifications for its Process, Quality, Environment, Occupational Health and Safety Management, commitments and responsibilities. It has built as well, strong global affiliations with several international galvanizing associations and authorities.\n\nIt will continue to spearhead galvanizing technology in the many years to come.', '0.00', '0.00', 0, 0, b'0'),
(91, 'Metalliqx (S) Pte Ltd', 'Blk 9012 Tampines St 93 #03-189  Singapore 52', 'info@metalliqx.com', '200719850H', '-', 'Metalliqx specialises in the production and application of liquid metal to create finishes that look and feel like solid metals. Since 2002, the company has been in the forefront of the metal coating industry in both Singapore and Malaysia. Its team of experts are constantly developing their knowledge and techniques of application to higher standards, meeting the exact specifications of designers and consumers when it comes to customising metal colours and effects. Each step of the process, from conception to completion, is carefully planned and executed in line with the company?s reputation for excellence in workmanship and the timely delivery of projects.\n\nMetalliqx Liquid Metal is made up of fine metal granules that are mixed with a specially formulated polymer binder. This mixture is then combined with an additive to produce a base that bonds well to various stable substrates. The coatings are of 0.5mm thickness and can be applied to virtually any substrate, including but not limited to, timber, MDF, acrylic, fibreglass, metal, concrete, glass, ceramics and plaster. By consistently exploring the potential of this innovative product, Metalliqx has created over 200 standard coatings to choose from, including surface effects such as waves, rust and patina. All Metalliqx quality products are warranted against cracking, delamination and peeling.\n\nMetalliqx offers innovative solutions for recreating metallic finishes for use in interior design, art and the outdoors. The use of liquid metal is a viable alternative for a metal finish that is product-efficient, cost-effective, durable, seamless in design and aesthetically captivating. The company values, and strives towards complete customer satisfaction, and is the choice for designers and artists who seek to recreate metallic finishes without the cost and weight of solid metal.\n\nWhy choose Liquid Metal from Metalliqx\n- Bonds well to virtually any substrate\n- Durable and hard wearing\n- Seamless finish\n- Cost-effective and time-efficient\n- Looks, feels and performs like solid metal, without the weight\n- Wide range of colours to choose from\n- Customizable to achieve desired colours and effects', '0.00', '0.00', 0, 0, b'0'),
(92, 'Progress Galvanizing Pte Ltd', '19 Tuas Rd, Singapore 638488', 'progress@progress-singapore.com.sg', '199101791K', '-', 'Established as Progress Manufacturing Pte Ltd in February 1986, the management\'s long-term planning to achieve continuous growth and to become a leader in the business had been visualized. With the right infrastructure in place supported by our experience and expertise, expansion into key markets has been successfully accomplished.\n \nIn June 1995, Progress Manufacturing Pte Ltd acquired Pole Technologies Pte Ltd to further strengthen the foothold in the region as the later provided the right support for the business.\n \nHaving looked beyond the boundaries of its home region and recognizing the market in the neighboring countries, we ventured into Philippines in early 1998 and followed by Malaysia in 2001.\n \nConstantly evolving to be relevant to the market and to concentrate resources to give the most to our customers, Progress Manufacturing Pte Ltd and Pole Technologies Pte Ltd were merged in October 2004. The name Progress Galvanizing Pte Ltd was chosen to better reflect the nature of the business.\n \nAs part of its commitment to customer service and quality standards, Progress Galvanizing Pte Ltd has achieved certification in ISO 9001, BS OHSAS 18001 and bizSAFE STAR.\n \nOur success has come from our long-standing focus on innovation and technology, in addition to our unique approach of providing solutions and our intense commitment to our customers. From a modest beginning, we have grown into a reputable local entity in the region.', '0.00', '0.00', 0, 0, b'0'),
(93, 'Thermic Coating Industries Pte Ltd', 'Blk 1046 Eunos Ave 5 #01-119  Singapore 40974', 'info@thermic.com.sg', '201011675H', '-', 'Thermic is an established coating company offering engineering services in Singapore (since 2002) and Indonesia (since 2007). Our core expertise is in the application of thermal spray coating and optimizing of coating quality for specific industrial applications through manipulating of material microstructures and surface properties. Our success in our performance has been based on proven engineering principles and years of hands on experiences in thermal spraying. We liaise closely with our customers from the first inquiry to the final invoice; it leads us through a very close partnership in maximizing our engineering expertise in resolving problems and in return meeting fast turn around time with minimum cost.', '0.00', '0.00', 0, 0, b'0'),
(94, 'Super Galvanising Pte Ltd', '1A Pioneer Sector Walk, Singapore 627895', '', '199603335K', '-', 'Super Galvanising Group has been providing the best, most cost effective way to protect steel based projects through Hot Dip Galvanising (HDG) for over 20 years. Our galvanising technology is the best protection money can buy against environmental corrosion. Through the years, tireless efforts have been made to educate many industries on the long term cost effectiveness of galvanising. \n\nThe simplicity of Super Galvanising is best expressed in its Mission Statement:\nWe are committed to total customer satisfaction, by maintaining excellent quality coupled with expeditious delivery and personalised services and support.\n\nKettle Size: 12.5m Long by 3.2m Deep by 1.8m Wide', '0.00', '0.00', 0, 0, b'0'),
(95, 'T?V S?D PSB Pte. Ltd.', '1 Science Park Drive\nSingapore 118221', 'chee-meng.lem@tuv-sud-psb.sg?', '199002667R', '-', 'T?V S?D PSB previously known as PSB Corporation is a service provider for a comprehensive and integrated suite of product testing, inspection, auditing, certification, training, and knowledge services. With a sterling record of over 40 years, T?V S?D PSB aims at helping companies achieve business excellence. As an established and internationally recognised testing body, T?V S?D PSB?s test reports and product certification marks are well accepted by manufacturers, third party buyers and government authorities worldwide. T?V S?D PSB is accredited under the Singapore Accreditation Council Singapore Laboratory Accreditation (SAC-Singlas) Scheme to ISO/IEC Guide 25 (ISO/IEC 17025) and ISO Guide 65 (ISO/IEC 17065). As a pioneer in providing management systems certification services, T?V S?D PSB was the first certification body in Asia to introduce ISO 9000 as a basis of quality system certification as well as ISO/TS 16949 automotive certification in the South East Asia region.\n\nToday, T?V S?D PSB is headquartered in Singapore with operations in Thailand, Indonesia, Malaysia, Philippines and Vietnam. It is a wholly owned subsidiary of T?V S?D.\n\nT?V S?D is a premium quality, safety, and sustainability solutions provider that specialises in testing, inspection, auditing, certification, training, and knowledge services. Represented by more than 24,000 employees across 1000 locations worldwide, T?V S?D holds accreditations in Europe, the Americas, the Middle East, Asia and Africa. By combining impartial expertise with invaluable insights, the company adds tangible value to businesses, consumers and the environment. The aim of T?V S?D is to support customers with a comprehensive suite of services worldwide to increase efficiency, reduce costs and manage risk.', '0.00', '0.00', 0, 0, b'0'),
(96, 'CAST Laboratories Pte Ltd', '17 Tuas Avenue 8, Singapore 639232', 'cast@castlab.com.sg\n', '\n198100652N', '-', 'As the world population continues to grow, new infrastructure needs to be built and existing infrastructure needs to be maintained to ensure a high standard of living. Despite the increased pace of construction, safety standards cannot be compromised as this has a direct impact on the lives of millions of people. To face this challenge, CAST Laboratories has committed itself in providing independent testing, inspection and certification services that meet local and international standards. The credibility and accuracy of CAST Laboratories? reports is why many companies in Singapore, Malaysia, Indonesia and other parts of Asia rely upon CAST Laboratories? comprehensive range of services.\n\nCAST Laboratories has a long history in testing services that dates back to 1981. From a small concrete testing facility in Singapore, CAST Laboratories has grown to become a highly-trusted testing laboratory in the region and an accredited laboratory roundly recognised by government bodies.\n\nTo drive its expansion into Asia, the company does not rest on its past achievements but continues to push itself to improve in every aspect of testing services. This is part of CAST Laboratories? relentless quest to stay ahead of its clients? testing requirements.\n\nGuided by its corporate values of Integrity Reliability and Unity, CAST Laboratories is ever closer to realising its vision of ?Contributing To A Safer Environment?. The company understands that the only way to become Southeast Asia?s leading testing company, and stay that way, is to deliver assured test results every time.\n\nCAST Laboratories Pte Ltd\nTrusted for Testing Since 1981', '0.00', '0.00', 0, 0, b'0'),
(97, 'Professional Testing Services Pte Ltd', '30-32 Kian Teck Road Singapore 628779', 'quotations@ptspl.com', '198500774K', '-', 'Professional Testing Services Private Limited is an independent Test Laboratory founded in 1985. Since then, we have gained recognition from the Oil & Gas, Offshore & Marine and Manufacturing industries as a leading provider of quick, reliable, and accurate testing of metals. We offer a comprehensive selection of services including mechanical tests, chemical and metallographic analysis, corrosion tests, non-destructive tests, welding consultancy, failure analysis, etc.\n\nTo reach out to clients in the regions, Professional Testing Services Sendirian Berhad was established in 1995 in Johor, Malaysia; and PT Professional Technology Specialist was set up in 2004 in Batam, Indonesia. All our laboratories in Singapore, Malaysia and Indonesia are accredited to ISO/IEC 17025:2005 by SAC-SINGLAS, SAMM and KAN respectively.\n\nWith our newly upgraded facilities and equipment, and a total group size of almost 150 dedicated staff, we are confident of exceeding all our client?s testing requirements.', '0.00', '0.00', 0, 0, b'0'),
(98, 'SGS Testing & Control Services Singapore Pte ', '3 Toh Tuck Link, #01-02/03, Singapore 596228', 'sgs.singapore@sgs.com', '\n199404065N', '-', 'SGS is the world?s leading inspection, verification, testing and certification company. We are recognized as the global benchmark for quality and integrity. With more than 95,000 employees, we operate a network of more than 2,400 offices and laboratories around the world.\n\nOur core services can be divided into four categories:\n\nInspection: our comprehensive range of world-leading inspection and verification services, such as checking the condition and weight of traded goods at transshipment, help you to control quantity and quality, and meet all relevant regulatory requirements across different regions and markets\nTesting: our global network of testing facilities, staffed by knowledgeable and experienced personnel, enable you to reduce risks, shorten time to market and test the quality, safety and performance of your products against relevant health, safety and regulatory standards\nCertification: we enable you to demonstrate that your products, processes, systems or services are compliant with either national or international standards and regulations or customer defined standards, through certification\nVerification: we ensure that products and services comply with global standards and local regulations. Combining global coverage with local knowledge, unrivalled experience and expertise in virtually every industry, SGS covers the entire supply chain from raw materials to final consumption.\n\nWe are constantly looking beyond customers? and society?s expectations in order to deliver market leading services wherever they are needed. As the leader in providing specialized business solutions that improve quality, safety and productivity and reduce risk, we help customers navigate an increasingly regulated world. Our independent services add significant value to our customers? operations and ensure business sustainability.\n\nAs well as delivering services that promote sustainable development, our values also show a commitment to corporate sustainability. For us, sustainability is about managing a long-term profitable business while taking into account all the positive and negative environmental, social and economic effects we have on society. You can find out more about our sustainability policies and program in our Corporate Sustainability section.', '0.00', '0.00', 0, 0, b'0'),
(99, 'DNV GL Singapore Pte Ltd', '16 Science Park Drive DNV GL Technology Centr', 'daqin.xu@dnvgl.com', '198200541Z', '-', 'DNV GL is a global quality assurance and risk management company. Driven by our purpose of safeguarding life, property and the environment, we enable our customers to advance the safety and sustainability of their business. We provide classification, technical assurance, software and independent expert advisory services to the maritime, oil & gas, power and renewables industries. We also provide certification, supply chain and data management services to customers across a wide range of industries. Combining technical, digital and operational expertise, risk methodology and in-depth industry knowledge, we empower our customers? decisions and actions with trust and confidence. We continuously invest in research and collaborative innovation to provide customers and society with operational and technological foresight. With origins stretching back to 1864 and operations in more than 100 countries, our experts are dedicated to helping customers make the world safer, smarter and greener.\n\nAs one of the world-class DNV GL laboratories, the Singapore laboratory has offered materials and structural testing and advisory services ? including fatigue, fracture and weld testing ? for over three decades in the Asia Pacific region, providing confidence to stakeholders of hundreds of oil and gas projects.  \n\nThe materials and metallurgical laboratory?s capability in bespoke testing and analysis are integrated with advisory solutions to help asset operators and engineering firms to address engineering criticality and fitness-for-service (FFS) challenges on structures, pipelines and other oil and gas assets with the aim to provide independent, realistic and safe solutions. Throughout the years, advanced laboratory testing and in-depth analysis techniques have been developed to meet the need of comprehensive ECA/FFS assessments and other advisory solutions.\n\nOur laboratory services related to ECA/FFS advisory: \nFatigue and fracture testing in simulated operating conditions including sour service environment with use of various specimen geometries (CT, SENB, SENT, Segment etc.)\nComprehensive assessment of materials/welds includes weld testing, integrity evaluation, metallurgical characterization and weldability simulation\nSalami slicing and detail examination of weld defect for qualification of AUT system \nFull-scale fatigue and fracture testing of welded structure and pipe to validate the ECA/FFS assessment and FEM simulation results.\nOur lab engineers and materials experts also use the state-of-the-art materials and metallurgical laboratory facility and expertise to provide customers with independent fatigue, fracture and weld testing and assessment to ensure the specific requirements of projects are met.  \n\nMaterials and Metallurgical lab services - independent third-party testing:  \nWeld testing to qualify the welder and Welding Procedure Specification (WPS)\nFatigue and fracture mechanics (CTOD/SENT/SENB) testing to assess the fracture toughness and fatigue crack growth rates of structural and pipeline materials and welds\nCorrosion testing to evaluate the resistance of Corrosion Resistance Alloys (CRA) to pitting corrosion, intergranular corrosion (IC) and stress corrosion cracking (SCC)\nSulphide Stress Corrosion (SSC) and Hydrogen Induced Cracking (HIC) to evaluate the susceptibility of the materials and weld to environment-assisted cracking (EC) in sour service environment\nAutoclave testing to select and qualify the materials in HPHT condition\nPipeline and Field Joint Coating (FJC) tests to qualify the product and application procedure against the project specification and pre-production requirement\nMaterial and weld testing for conformity check in term of mechanical property, metallurgical condition and chemical composition.\nUnderstanding the failure cause of materials, component and structure is vital to mitigate the problem and prevent the recurrence of failure. Root Cause Analysis (RCA), encompassing laboratory examination and analysis, are usually carried out by DNV GL to help the industry address the issue fundamentally, so that appropriate measures can be implemented for a safe and sustainable operation. With modern materials and our metallurgical lab, we combine the global expertise of DNV GL to locally assist our customers in investigating the failure of materials, weld, component and/or structure. \n\nServices related to laboratory failure analysis and root cause analyses (RCA): \nOn-site inspection, condition assessment, data and sample collection\nIn-situ metallurgical tests, examination and defect sizing\nLaboratory mechanical test, metallurgical evaluation and chemical analysis\nDetail fractographic examination and study by optical microscopy and SEM/EDX techniques\nRCA workshop facilitation with involvement of project team and DNV GL?s subject matter experts to systematically address possible contributing factors from design, fabrication/installation to operation to enable determination of immediate and root causes\nMaterial selection and corrosion assessment\nRecommending mitigation and prevention measures\nWeldability assessment and testing, welding procedure development\nPipeline and structural repair solutions and detailed terms of reference\nDetailed 3D Non-linear Finite Element Analyses to determine environmental or thermal stresses\nForensic analyses and expert witness for arbitration and litigation court cases.\nThe unique set and broad range of capabilities of our Singapore lab enable us to serve not only the oil and gas industry but also maritime, energy, infrastructure and other general industry.  \n\nOther services we offer: \nWeighing structure and module in fabrication yard upon completion for safe loadout and transportation of heavy and costly asset\nConcrete sleeper and rail components testing and qualification\nProof load, pressure and torque test of component\nQualification test of bridge bearing\nCalibration of load and pressure equipment - load cell, hydraulic Jack and transducer\nOn-site calibration of test bed, loading equipment and test rig\nIn-situ stress and strain gauging and measurement \nNoise and vibration measurement on board vessel and offshore platform\nQualification of Additively Manufactured (AM) product and component.', '0.00', '0.00', 0, 0, b'0'),
(100, 'GKE Corporation Limited', '39 Benoi Road,#06-01, Singapore 627725', 'gkelog@gkegroup.com.sg', '\n200001941G', '-', 'Established in 2005, GKE Express Logistics Pte Ltd operates on GKE\'s specialized project logistics business. We provide services that include the provision of heavy haulage services, marine transportation services and project management services.\n\nOur customer service team is the one in charge of liaising with our customers. They oversee customers\' job, project requests, ensuring that customers\' requirements are met on time. They keep customers up-to-date on job status and container status.\n\nOur traffic control team is the one in charge of planning and coordination of job schedules. They split the tasks among our drivers for deployment. This prevents clashes in the schedule that can lead to service disruptions and ensure that customers\' jobs are fulfilled on time.\n\nOur operations team is in-charge of the project management jobs like stuffing and un-stuffing, heavy lifting etc. With years of experience, customers can be assured that their cargos are carefully handled by professionals.\nOur Operational Capability\n? Qualified Operational Team\n? Customer Service Team-Order Management\n? Control Team\n? Planning & Schedule\n? Control & Follow Up\n\nOur Equipment Resources:\n? Expanding fleet of Prime Movers (currently at 40 units) consisting of 6-wheeled, 10-wheeled, Pneumatics\n? Equipment (250 units)\no Skeleton Chassis for container trucking\no Platforms for break-bulk cargo\no Low bed for Out-of-Gauge cargo\no Air ride for pneumatics-sensitive cargo\n\nOur Team Is Experienced In:\n? Providing customized solutions to meet specialized project logistics needs.\n? Moving various sizes of project cargo.\n? Managing customs procedures and regulations.\n? Applications of official permits, planning for integrated operations, coordination of equipment, venues and schedules.\n\nList Of Services We Provide:\n? Transportation Services:\no Standard FCL & LCL Transportation\no OOG (Out-of-Gauge) Transportation\no Air-ride for Shock Indicated Cargo\n? Project Logistics:\no Planning & Management\no Heavy Haulage & Handling Services\no Cargo and Site Survey\n? Additional Services:\no Stuffing & Un-stuffing\no Handle Transhipment Cargo with Bonded \nFacility Break-bulk\no Container & Storage', '0.00', '0.00', 0, 0, b'0');
INSERT INTO `m_company` (`Id`, `Name`, `Address`, `Domain`, `Reg_No`, `Code`, `About`, `SupplierAvgRating`, `BuyerAvgRating`, `AwardedQuotation`, `SubmittedQuotation`, `IsVerified`) VALUES
(101, 'TSA', 'sg', '', '123456789a', '', 'hoka (English: /???o?k?/; IAST: A?oka; died 232 BCE)[5], or Ashoka the Great, was an Indian emperor of the Maurya Dynasty, who ruled almost all of the Indian subcontinent from c.?268 to 232 BCE.[6] He was the grandson of the founder of the Maurya Dynasty, Chandragupta Maurya, who had created one of the largest empires in ancient India and then, according to Jain sources, renounced it all to become a Jain monk.[7] One of India\'s greatest emperors, Ashoka expanded Chandragupta\'s empire, and reigned over a realm that stretched from present-day Afghanistan in the west to Bangladesh in the east. It covered the entire Indian subcontinent except for parts of present-day Tamil Nadu, Karnataka and Kerala. The empire\'s capital was Pataliputra (in Magadha, present-day Patna), with provincial capitals at Taxila and Ujjain.\r\n\r\nIn about 260 BCE, Ashoka waged a destructive war against the state of Kalinga (modern Odisha).[8] He conquered Kalinga, which none of his ancestors had done.[9] Some scholars suggest he belonged to the Jain tradition, but it is generally accepted that he embraced Buddhism.[10] Legends state he converted after witnessing the mass deaths of the Kalinga War, which he himself had waged out of a desire for conquest. \"Ashoka reflected on the war in Kalinga, which reportedly had resulted in more than 100,000 deaths and 150,000 deportations, ending at around 200,000 deaths.\"[11] Ashoka converted to Buddhism about 263 BCE.[8] He is remembered for the Ashoka pillars and edicts, for sending Buddhist monks to Sri Lanka and Central Asia, and for establishing monuments marking several significant sites in the life of Gautama Buddha.[12]\r\n\r\nBeyond the Edicts of Ashoka, biographical information about him relies on legends written centuries later, such as the 2nd-century CE Ashokavadana (\"Narrative of Ashoka\", a part of the Divyavadana), and in the Sri Lankan text Mahavamsa (\"Great Chronicle\"). The emblem of the modern Republic of India is an adaptation of the Lion Capital of Ashoka. Ashoka\'s name \"A?oka\" means \"painless, without sorrow\" in Sanskrit (the a privativum and ?oka, \"pain, distress\"). In his edicts, he is referred to as Dev?n?mpriya (Pali Dev?na?piya or \"the Beloved of the Gods\"), and Priyadar?in (Pali Piyadas? or \"He who regards everyone with affection\"). His fondness for his name\'s connection to the Saraca asoca tree, or \"Ashoka tree\", is also referenced in the Ashokavadana. H.G. Wells wrote of Ashoka in his book The Outline of History: \"Amidst the tens of thousands of names of monarchs that crowd the columns of history, their majesties and graciousnesses and serenities and royal highnesses and the like, the name of Ashoka shines, and shines, almost alone, a star.', NULL, NULL, NULL, NULL, b'0');
